	[18008] = {talk_id = 18008, group_id = 18, type = 3, next_id = 0, talk_content = "所谓多个人多分力，我对青乌也很感兴趣呢。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[18009] = {talk_id = 18009, group_id = 18, type = 3, next_id = 0, talk_content = "那就成了，我们走吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[19001] = {talk_id = 19001, group_id = 19, type = 4, next_id = 19002, talk_content = "顺带一提，我使用的武器是咒符和手枪，要瞄准什么就交给我吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {19001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[19002] = {talk_id = 19002, group_id = 19, type = 4, next_id = 19003, talk_content = "倒是之后能不能也让我见识一下\n青乌‘治愈’的本事？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[19003] = {talk_id = 19003, group_id = 19, type = 4, next_id = 0, talk_content = "那个就算看了也学不会哦。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[20001] = {talk_id = 20001, group_id = 20, type = 5, next_id = 20002, talk_content = "总算是到了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 0, fade_out = false, relevance_id = {20001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[20002] = {talk_id = 20002, group_id = 20, type = 5, next_id = 20003, talk_content = "这个状况……叙慕，你在追的到底是什么东西？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[20003] = {talk_id = 20003, group_id = 20, type = 5, next_id = 20004, talk_content = "我好像没说过我在‘追’什么吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[20004] = {talk_id = 20004, group_id = 20, type = 5, next_id = 20005, talk_content = "那所以呢，你在追的到底是什么？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[20005] = {talk_id = 20005, group_id = 20, type = 5, next_id = 20006, talk_content = "东方之地的背叛者，离歌。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[20006] = {talk_id = 20006, group_id = 20, type = 5, next_id = 0, talk_content = "哼哼……", talk_name = "远处的声音", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[21001] = {talk_id = 21001, group_id = 21, type = 5, next_id = 21002, talk_content = "这什么玩意，这地方还有这等级的怪物？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {21001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[21002] = {talk_id = 21002, group_id = 21, type = 5, next_id = 21003, talk_content = "你，叙慕，我知道你会来的。", talk_name = "神荼", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[21003] = {talk_id = 21003, group_id = 21, type = 5, next_id = 21004, talk_content = "你们俩认识吗？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[21004] = {talk_id = 21004, group_id = 21, type = 5, next_id = 21005, talk_content = "所以你也是离歌的其中一个宠物对吧，离歌她人在哪？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[21005] = {talk_id = 21005, group_id = 21, type = 5, next_id = 21006, talk_content = "不答……吾乃神荼，创生之恶神，左门之将。", talk_name = "神荼", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[21006] = {talk_id = 21006, group_id = 21, type = 5, next_id = 0, talk_content = "不能让你，妨碍那位大人的行动。", talk_name = "神荼", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
