	[23001] = {talk_id = 23001, group_id = 23, type = 4, next_id = 23002, talk_content = "……还会再见的，叙慕。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {23001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[23002] = {talk_id = 23002, group_id = 23, type = 4, next_id = 23003, talk_content = "等等，离歌！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[23003] = {talk_id = 23003, group_id = 23, type = 4, next_id = 23004, talk_content = "对着幻影喊也没用吧……唉，我们先离开这里吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[23004] = {talk_id = 23004, group_id = 23, type = 4, next_id = 0, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[24001] = {talk_id = 24001, group_id = 24, type = 5, next_id = 24002, talk_content = "那边的，先别急着走！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 0, fade_out = false, relevance_id = {24001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[24002] = {talk_id = 24002, group_id = 24, type = 5, next_id = 24003, talk_content = "嗯？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[24003] = {talk_id = 24003, group_id = 24, type = 5, next_id = 0, talk_content = "果然我没看错呢。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25001] = {talk_id = 25001, group_id = 25, type = 1, next_id = 25002, talk_content = "太厉害了，没想到竟然会有能打倒龙的脉者路过此地。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {25001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25002] = {talk_id = 25002, group_id = 25, type = 1, next_id = 25003, talk_content = "我的名字是多闻，现在城里的负责人。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25003] = {talk_id = 25003, group_id = 25, type = 1, next_id = 25004, talk_content = "我们只是刚好受了于静拜托而已。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25004] = {talk_id = 25004, group_id = 25, type = 1, next_id = 25005, talk_content = "也就是说她没事对吧，太好了。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25005] = {talk_id = 25005, group_id = 25, type = 1, next_id = 25006, talk_content = "嗯，她一个人跑到外面去找救兵呢。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25006] = {talk_id = 25006, group_id = 25, type = 1, next_id = 25007, talk_content = "对了，关于刚刚骑在龙上的女人，你们有知道些什么吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25007] = {talk_id = 25007, group_id = 25, type = 1, next_id = 25008, talk_content = "呃，知道些什么是指？", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25008] = {talk_id = 25008, group_id = 25, type = 1, next_id = 25009, talk_content = "她在这里的目的，她藏身于哪里，\n我是因为追捕她才一路来到这个地方的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25009] = {talk_id = 25009, group_id = 25, type = 1, next_id = 25010, talk_content = "这个我不太清楚，但城里有好些居民\n在之前都说看见过龙飞在天上的样子。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25010] = {talk_id = 25010, group_id = 25, type = 1, next_id = 25011, talk_content = "也就是说可以从这些地方入手呢。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25011] = {talk_id = 25011, group_id = 25, type = 1, next_id = 25012, talk_content = "……言下之意是你要继续和我一起行动？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25012] = {talk_id = 25012, group_id = 25, type = 1, next_id = 25013, talk_content = "相遇是缘，再说也不能放着那样的魔头不管。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25013] = {talk_id = 25013, group_id = 25, type = 1, next_id = 25014, talk_content = "说见过龙的居民就在广场附近，我还得确认居民的状况，就……", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[25014] = {talk_id = 25014, group_id = 25, type = 1, next_id = 0, talk_content = "嗯，你先处理城里的事情，我会四处打听的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[26001] = {talk_id = 26001, group_id = 26, type = 1, next_id = 26002, talk_content = "噬脉生物和龙突然往小城附近聚集，对我来说那景象和世界末日差不多。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {26001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[26002] = {talk_id = 26002, group_id = 26, type = 1, next_id = 0, talk_content = "请让我再次为刚才的事情感谢你们，两位脉者。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[27001] = {talk_id = 27001, group_id = 27, type = 4, next_id = 27002, talk_content = "广场指的是那棵星辰木附近的区域吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {27001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[27002] = {talk_id = 27002, group_id = 27, type = 4, next_id = 27003, talk_content = "原来那样的叫星辰木。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[27003] = {talk_id = 27003, group_id = 27, type = 4, next_id = 27004, talk_content = "你不是没见过吧？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[27004] = {talk_id = 27004, group_id = 27, type = 4, next_id = 27005, talk_content = "嗯，我故乡的气脉根本没法凝聚成那种状态。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[27005] = {talk_id = 27005, group_id = 27, type = 4, next_id = 0, talk_content = "那到底是什么乡下地方。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[28001] = {talk_id = 28001, group_id = 28, type = 1, next_id = 28002, talk_content = "你好，关于刚刚骑在龙上的那个女人，你知道些什么吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {28001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[28002] = {talk_id = 28002, group_id = 28, type = 1, next_id = 28003, talk_content = "那位女性的事情我不太清楚，但那条骑龙我上周曾见过它一次。", talk_name = "莉莉", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[28003] = {talk_id = 28003, group_id = 28, type = 1, next_id = 28004, talk_content = "位置是？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[28004] = {talk_id = 28004, group_id = 28, type = 1, next_id = 28005, talk_content = "在前往港口城市何罗的路上，它就在天空中盘旋\n……我还以为要被吃掉了。", talk_name = "莉莉", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[28005] = {talk_id = 28005, group_id = 28, type = 1, next_id = 28006, talk_content = "盘旋，那是在找什么的动作吧？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[28006] = {talk_id = 28006, group_id = 28, type = 1, next_id = 0, talk_content = "可到底是要找什么……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[29001] = {talk_id = 29001, group_id = 29, type = 1, next_id = 0, talk_content = "话说你们就是打败了那条龙的人吧，实在是太帅了！", talk_name = "莉莉", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {29001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[30001] = {talk_id = 30001, group_id = 30, type = 1, next_id = 30002, talk_content = "你好，关于刚刚骑在龙上的那个女人，你知道些什么吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {30001, 30005, 30006, 30007}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[30002] = {talk_id = 30002, group_id = 30, type = 1, next_id = 30003, talk_content = "不清楚，但我听说最近通往生命环的道路似乎因为什么原因被封闭了。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[30003] = {talk_id = 30003, group_id = 30, type = 1, next_id = 30004, talk_content = "生命环是什么地方？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[30004] = {talk_id = 30004, group_id = 30, type = 2, next_id = 0, talk_content = "是放着噬脉太阳残骸的地方，本身也是创生地最高的建筑哦。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"叫生命环却放残骸吗？", 30006}, {"噬脉太阳的残骸？", 30005}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[30005] = {talk_id = 30005, group_id = 30, type = 3, next_id = 30007, talk_content = "就是坠日战争中被打败的噬脉太阳的躯壳，虽然我也没见过就是了。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[30006] = {talk_id = 30006, group_id = 30, type = 3, next_id = 30007, talk_content = "嗯，因为那似乎是用来维持残骸不让其完全失去活性的设施。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[30007] = {talk_id = 30007, group_id = 30, type = 1, next_id = 0, talk_content = "看来值得一去呢，谢谢了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31001] = {talk_id = 31001, group_id = 31, type = 1, next_id = 31002, talk_content = "这些日子我总有不详的预感，然后那条飞龙就突然出现在城外了。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {31001, 31003, 31004}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31002] = {talk_id = 31002, group_id = 31, type = 2, next_id = 0, talk_content = "接下来不要再发生什么就好了。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"嗯，再见。", 31003}, {"能和我详细说说噬脉太阳吗？", 31004}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31003] = {talk_id = 31003, group_id = 31, type = 3, next_id = 0, talk_content = "嗯，再见。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31004] = {talk_id = 31004, group_id = 31, type = 3, next_id = 31005, talk_content = "详细说……我想想，你应该知道数百年前发生的坠日战争吧？", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31005] = {talk_id = 31005, group_id = 31, type = 3, next_id = 31006, talk_content = "九个噬脉太阳突然升起，噬脉生物以太阳为旗聚集在一起攻击生灵。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31006] = {talk_id = 31006, group_id = 31, type = 3, next_id = 31007, talk_content = "而人类这边也团结起来一同抗击敌人，最终在付出巨大代价后获胜。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31007] = {talk_id = 31007, group_id = 31, type = 3, next_id = 31008, talk_content = "这就是那场战争的简述，而这些噬脉太阳被打败后都留下了大小不一的‘残骸’。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31008] = {talk_id = 31008, group_id = 31, type = 3, next_id = 31009, talk_content = "然后就被人保存起来了对吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31009] = {talk_id = 31009, group_id = 31, type = 3, next_id = 31010, talk_content = "嗯，不过即便是残骸听说也不断散发着诡异的能量。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[31010] = {talk_id = 31010, group_id = 31, type = 3, next_id = 0, talk_content = "唉，要是我的话肯定会当场把那种可怕的东西毁掉。", talk_name = "安晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[32001] = {talk_id = 32001, group_id = 32, type = 1, next_id = 32002, talk_content = "你好，关于刚刚骑在龙上的那个女人，你知道些什么吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {32001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[32002] = {talk_id = 32002, group_id = 32, type = 1, next_id = 32003, talk_content = "对不起，我不知道。", talk_name = "于用", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[32003] = {talk_id = 32003, group_id = 32, type = 1, next_id = 32004, talk_content = "但我可是注意到了，她手上有和噬脉生物一样的东西……", talk_name = "于用", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[32004] = {talk_id = 32004, group_id = 32, type = 1, next_id = 32005, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[32005] = {talk_id = 32005, group_id = 32, type = 1, next_id = 32006, talk_content = "（在游历回到故乡以后……离歌的手就变成那样了。）", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[32006] = {talk_id = 32006, group_id = 32, type = 1, next_id = 0, talk_content = "（恐怕不止是手，就连身体的其他地方也……）", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[33001] = {talk_id = 33001, group_id = 33, type = 1, next_id = 0, talk_content = "话说小静怎么还不回来呢。", talk_name = "于用", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {33001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[34001] = {talk_id = 34001, group_id = 34, type = 4, next_id = 34002, talk_content = "该问的都问过了，接下来要不要到附近整理一下情报？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {34001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[34002] = {talk_id = 34002, group_id = 34, type = 4, next_id = 0, talk_content = "我刚听说那边有辉光蜻蜓的货车，\n还可以顺便修理一下装备哦。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35001] = {talk_id = 35001, group_id = 35, type = 1, next_id = 35002, talk_content = "你好，我听说这里能修理装备对吗，我手上的剑……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {35001, 35003, 35004, 35005}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35002] = {talk_id = 35002, group_id = 35, type = 2, next_id = 0, talk_content = "不，不好了，我的店员失踪了！", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"失踪？", 35003}, {"你先冷静下来。", 35004}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35003] = {talk_id = 35003, group_id = 35, type = 3, next_id = 35005, talk_content = "对，阿飞她不知道到哪去了！", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35004] = {talk_id = 35004, group_id = 35, type = 3, next_id = 35005, talk_content = "对，对不起……", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35005] = {talk_id = 35005, group_id = 35, type = 1, next_id = 35006, talk_content = "感觉走到哪都能碰上麻烦事呢，总之能和我们说说你员工吗？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35006] = {talk_id = 35006, group_id = 35, type = 1, next_id = 35007, talk_content = "嗯，失踪的员工叫阿飞，是我最近招聘的帮工。", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35007] = {talk_id = 35007, group_id = 35, type = 1, next_id = 35008, talk_content = "阿飞……你是什么时候发现她失踪的呢？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35008] = {talk_id = 35008, group_id = 35, type = 1, next_id = 35009, talk_content = "就刚才，在龙之前有一批噬脉生物冲进了城里，于是我们分头避难……", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35009] = {talk_id = 35009, group_id = 35, type = 1, next_id = 35010, talk_content = "对，她可能是被噬脉生物捉住了，当时我躲在房里听见了某人的惨叫！", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35010] = {talk_id = 35010, group_id = 35, type = 1, next_id = 35011, talk_content = "要真是那样就麻烦了，你知道它们往哪个方向去了吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35011] = {talk_id = 35011, group_id = 35, type = 1, next_id = 35012, talk_content = "那时候我往窗外轻轻瞟了眼……大概是从城的后门，往星碑走道去了。", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35012] = {talk_id = 35012, group_id = 35, type = 1, next_id = 35013, talk_content = "那不是我们来的方向吗？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35013] = {talk_id = 35013, group_id = 35, type = 1, next_id = 35014, talk_content = "擦肩而过……还是说噬脉生物有什么奇怪的移动方法呢。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35014] = {talk_id = 35014, group_id = 35, type = 1, next_id = 35015, talk_content = "想太多也没用，救人要紧，我们先回头看看吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[35015] = {talk_id = 35015, group_id = 35, type = 1, next_id = 0, talk_content = "哎，你们是要帮我吗，太好了，阿飞有救了！", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[36001] = {talk_id = 36001, group_id = 36, type = 1, next_id = 36002, talk_content = "捉住阿飞的噬脉生物往星碑走道的方向去了。", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {36001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[36002] = {talk_id = 36002, group_id = 36, type = 1, next_id = 0, talk_content = "求求你们，救救阿飞吧！", talk_name = "温度纱", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[37001] = {talk_id = 37001, group_id = 37, type = 4, next_id = 37002, talk_content = "逃不掉了吗？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {37001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[37002] = {talk_id = 37002, group_id = 37, type = 4, next_id = 37003, talk_content = "叙慕，前面有人被噬脉生物围住了。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[37003] = {talk_id = 37003, group_id = 37, type = 4, next_id = 0, talk_content = "解决他们！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38001] = {talk_id = 38001, group_id = 38, type = 1, next_id = 38002, talk_content = "感谢你们出手相助……呃，你们是？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {38001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38002] = {talk_id = 38002, group_id = 38, type = 1, next_id = 38003, talk_content = "受托来救人的脉者，看你这身打扮，你是阿飞没错吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38003] = {talk_id = 38003, group_id = 38, type = 1, next_id = 38004, talk_content = "对，对，我就是阿飞，难道是店长拜托你们的吗？", talk_name = "阿飞", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38004] = {talk_id = 38004, group_id = 38, type = 1, next_id = 38005, talk_content = "嗯，你没事就好，我们先回去吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38005] = {talk_id = 38005, group_id = 38, type = 1, next_id = 38006, talk_content = "等等，还有其他人被捉住了！", talk_name = "阿飞", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38006] = {talk_id = 38006, group_id = 38, type = 1, next_id = 38007, talk_content = "还有？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38007] = {talk_id = 38007, group_id = 38, type = 1, next_id = 38008, talk_content = "嗯，除了我还有一个被捉住的人，我本以为能带她一起逃出来，但……", talk_name = "阿飞", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38008] = {talk_id = 38008, group_id = 38, type = 1, next_id = 38009, talk_content = "那你是从哪逃出来的？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38009] = {talk_id = 38009, group_id = 38, type = 1, next_id = 38010, talk_content = "过了桥以后就能看见一个怪物据点，怪物都盘踞在那里。", talk_name = "阿飞", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38010] = {talk_id = 38010, group_id = 38, type = 1, next_id = 38011, talk_content = "过桥，是刚刚看漏了什么吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38011] = {talk_id = 38011, group_id = 38, type = 1, next_id = 38012, talk_content = "或许是之后才创造出来的说不定，\n噬脉生物操控点什么这事再正常不过了。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[38012] = {talk_id = 38012, group_id = 38, type = 1, next_id = 0, talk_content = "接下来的路我一个人走回去就行，剩下的那位就拜托你们了。", talk_name = "阿飞", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[39001] = {talk_id = 39001, group_id = 39, type = 1, next_id = 39002, talk_content = "好久没跑步，现在有些呼吸不过来。", talk_name = "阿飞", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {39001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[39002] = {talk_id = 39002, group_id = 39, type = 1, next_id = 0, talk_content = "我再休息一下就会回去，你们就不用担心我了。", talk_name = "阿飞", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[40001] = {talk_id = 40001, group_id = 40, type = 4, next_id = 40002, talk_content = "那个就是噬脉生物的据点，人好像也在里面。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {40001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[40002] = {talk_id = 40002, group_id = 40, type = 4, next_id = 0, talk_content = "那身影总觉得在哪见过。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41001] = {talk_id = 41001, group_id = 41, type = 2, next_id = 0, talk_content = "我就知道你会来救我的，叙慕！", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {{"怎么又是你？", 41003}, {"你是谁？", 41002}}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {41001, 41002, 41003, 41004}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41002] = {talk_id = 41002, group_id = 41, type = 3, next_id = 41004, talk_content = "我是于静，之前被你救下来的被噬脉生物袭击的于静！", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41003] = {talk_id = 41003, group_id = 41, type = 3, next_id = 41004, talk_content = "总感觉你的话语中带了点轻蔑……", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41004] = {talk_id = 41004, group_id = 41, type = 1, next_id = 41005, talk_content = "总之谢谢你们，我还以为要被怪物们吃掉了。", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41005] = {talk_id = 41005, group_id = 41, type = 1, next_id = 41006, talk_content = "所以你为什么会被捉住了，之前追赶你的怪物都被我解决了不是吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41006] = {talk_id = 41006, group_id = 41, type = 1, next_id = 41007, talk_content = "可在那之后我就被另一群噬脉生物盯上……早知道就和你一起走了。", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41007] = {talk_id = 41007, group_id = 41, type = 1, next_id = 41008, talk_content = "哎，还真是多灾多难，不过没事就好，我们回去吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[41008] = {talk_id = 41008, group_id = 41, type = 1, next_id = 0, talk_content = "嗯，这次我会好好跟着你们的。", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[42001] = {talk_id = 42001, group_id = 42, type = 4, next_id = 42002, talk_content = "终于到家了，我去和姐姐报个平安！", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {42001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[42002] = {talk_id = 42002, group_id = 42, type = 4, next_id = 0, talk_content = "这人行动力还真高。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[43001] = {talk_id = 43001, group_id = 43, type = 1, next_id = 43002, talk_content = "谢谢你们把小静带回来，那孩子什么都好，但就是太活泼了。", talk_name = "于用", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {43001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[43002] = {talk_id = 43002, group_id = 43, type = 1, next_id = 0, talk_content = "方才城里被袭击的时候也是一溜烟地不知道跑哪了。", talk_name = "于用", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[44001] = {talk_id = 44001, group_id = 44, type = 1, next_id = 44002, talk_content = "对了，这是帮了我的报酬，谢谢你们啦！", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {44001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[44002] = {talk_id = 44002, group_id = 44, type = 1, next_id = 44003, talk_content = "呃，这是什么？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
