	[48001] = {talk_id = 48001, group_id = 48, type = 1, next_id = 0, talk_content = "下次再碰见麻烦的话也拜托你们了哦！", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {48001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[49001] = {talk_id = 49001, group_id = 49, type = 5, next_id = 49002, talk_content = "叙慕，故乡已亡，青乌之血也再无意义。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 0, fade_out = false, relevance_id = {49001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
