	[49004] = {talk_id = 49004, group_id = 49, type = 5, next_id = 0, talk_content = "由漆金而起的血脉，就由漆金来斩断吧。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[50001] = {talk_id = 50001, group_id = 50, type = 4, next_id = 50002, talk_content = "前面的路……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {50001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[50002] = {talk_id = 50002, group_id = 50, type = 4, next_id = 0, talk_content = "附近有几个类似机关的东西，要不让我来射击试试看？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[51001] = {talk_id = 51001, group_id = 51, type = 1, next_id = 0, talk_content = "熙来就在前面，就拜托你了，叙慕！", talk_name = "于静", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {51001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[52001] = {talk_id = 52001, group_id = 52, type = 5, next_id = 52002, talk_content = "在星辰世界中存在着名为气脉的生命之源以及蚕食气脉的噬脉生物。", talk_name = "", back_groud = "", back_text = "simingwulunfashengheshiwodoubuhuigaibianzijideyuwang\nshijiebidinghuibeihuimieshengmingbixuzuochugaibian\nzaiyiqiezhongjiedeshihou\nwoliangzaiyiqixiangzhexingchenzhiwangdeyuzuoqianxingba\n\n\t\t\tbeimoqudemingzi", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = -1, fade_out = false, relevance_id = {52001}, addition_relevance_id = {3001}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[52002] = {talk_id = 52002, group_id = 52, type = 5, next_id = 52003, talk_content = "遭到蚕食的气脉会被破坏，最终导致环境恶化，生灵涂炭。", talk_name = "", back_groud = "", back_text = "simingwulunfashengheshiwodoubuhuigaibianzijideyuwang\nshijiebidinghuibeihuimieshengmingbixuzuochugaibian\nzaiyiqiezhongjiedeshihou\nwoliangzaiyiqixiangzhexingchenzhiwangdeyuzuoqianxingba\n\n\t\t\tbeimoqudemingzi", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[52003] = {talk_id = 52003, group_id = 52, type = 5, next_id = 52004, talk_content = "能够遏制这些侵蚀，治愈气脉之伤的人则被世人称为青乌。", talk_name = "", back_groud = "", back_text = "simingwulunfashengheshiwodoubuhuigaibianzijideyuwang\nshijiebidinghuibeihuimieshengmingbixuzuochugaibian\nzaiyiqiezhongjiedeshihou\nwoliangzaiyiqixiangzhexingchenzhiwangdeyuzuoqianxingba\n\n\t\t\tbeimoqudemingzi", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[52004] = {talk_id = 52004, group_id = 52, type = 5, next_id = 0, talk_content = "如今，最后的青乌叙慕为了追回故乡的神器‘漆金’踏上了追逐恶徒的旅途。", talk_name = "", back_groud = "", back_text = "simingwulunfashengheshiwodoubuhuigaibianzijideyuwang\nshijiebidinghuibeihuimieshengmingbixuzuochugaibian\nzaiyiqiezhongjiedeshihou\nwoliangzaiyiqixiangzhexingchenzhiwangdeyuzuoqianxingba\n\n\t\t\tbeimoqudemingzi", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
