	[54001] = {talk_id = 54001, group_id = 54, type = 4, next_id = 54002, talk_content = "事情都办完了的话要不要到创生地其他地方看看？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {54001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[54002] = {talk_id = 54002, group_id = 54, type = 4, next_id = 54003, talk_content = "可是城的出入口似乎被什么堵上了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[54003] = {talk_id = 54003, group_id = 54, type = 4, next_id = 0, talk_content = "这种事情向‘市长’问问不就好了。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55001] = {talk_id = 55001, group_id = 55, type = 1, next_id = 55002, talk_content = "我听说你们把失散的人都找回来了，谢谢你们。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 0, fade_out = false, relevance_id = {55001, 55010, 55011, 55012}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55002] = {talk_id = 55002, group_id = 55, type = 1, next_id = 55003, talk_content = "只是举手之劳而已，倒是我们想要出城，挡在出入口的东西是什么呢？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55003] = {talk_id = 55003, group_id = 55, type = 1, next_id = 55004, talk_content = "是利用气脉形成的无形之墙，在怪物靠近的时候就会启动。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55004] = {talk_id = 55004, group_id = 55, type = 1, next_id = 55005, talk_content = "本是没有危险后就会自动关闭的东西，但似乎在之前袭击的时候被弄坏了。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55005] = {talk_id = 55005, group_id = 55, type = 1, next_id = 55006, talk_content = "该不会现在谁也没办法出城吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55006] = {talk_id = 55006, group_id = 55, type = 1, next_id = 55007, talk_content = "也不是这样，现在要出城的话可以在城里面找找门的钥匙。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55007] = {talk_id = 55007, group_id = 55, type = 1, next_id = 55008, talk_content = "找？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55008] = {talk_id = 55008, group_id = 55, type = 1, next_id = 55009, talk_content = "嗯，维护这道门的人将钥匙分成三份放在了各个建筑的高处。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55009] = {talk_id = 55009, group_id = 55, type = 2, next_id = 55010, talk_content = "仔细找找应该是能找到的。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"为什么要放在高处？", 55010}, {"让维护门的人开门不就好了？", 55011}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55010] = {talk_id = 55010, group_id = 55, type = 3, next_id = 55012, talk_content = "是维护人的癖好，因为是主城派来的我也不好说些什么……", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55011] = {talk_id = 55011, group_id = 55, type = 3, next_id = 55012, talk_content = "那位在前几天到另一个城去研究学习了，恐怕还要好几天才能回来。", talk_name = "多闻", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[55012] = {talk_id = 55012, group_id = 55, type = 1, next_id = 0, talk_content = "唉，总之我们就在房顶上找找看吧，总比什么都不干要强。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[56001] = {talk_id = 56001, group_id = 56, type = 4, next_id = 56002, talk_content = "没想到还有在房顶上寻宝的一天呢。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {56001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[56002] = {talk_id = 56002, group_id = 56, type = 4, next_id = 56003, talk_content = "到底是什么人才会把钥匙丢那种地方……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[56003] = {talk_id = 56003, group_id = 56, type = 4, next_id = 0, talk_content = "像离歌那样骑龙的人？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[57001] = {talk_id = 57001, group_id = 57, type = 4, next_id = 57002, talk_content = "一二，三，都找齐了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {57001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[57002] = {talk_id = 57002, group_id = 57, type = 4, next_id = 0, talk_content = "那现在就到门那边去吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[58001] = {talk_id = 58001, group_id = 58, type = 1, next_id = 58002, talk_content = "这是……？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = true, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {58001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
