	[62002] = {talk_id = 62002, group_id = 62, type = 1, next_id = 0, talk_content = "像是刚刚的袭击，即使联系了主城也需要等好一阵子才能有人赶来。", talk_name = "市民", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[63001] = {talk_id = 63001, group_id = 63, type = 1, next_id = 0, talk_content = "某些地理学家说创生地这里曾有过星辰之穴。", talk_name = "市民", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {63001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
