	[64002] = {talk_id = 64002, group_id = 64, type = 1, next_id = 64003, talk_content = "但相对的那周围基本都会有强大的噬脉生物，一般人可靠近不了。", talk_name = "市民", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
