	[68002] = {talk_id = 68002, group_id = 68, type = 3, next_id = 0, talk_content = "创生地的主城名为时珍，\n是以创建者的名字来命名的生态研究据点。", talk_name = "市民", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
