	[101010104] = {talk_id = 101010104, group_id = 1010101, type = 1, next_id = 101010105, talk_content = "曾经拯救过世界的青乌……", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
