	[101010106] = {talk_id = 101010106, group_id = 1010101, type = 3, next_id = 0, talk_content = "太好了，不枉我花费了这么多功夫，青乌，你能记起你本来的名字吗？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
