	[101010202] = {talk_id = 101010202, group_id = 1010102, type = 5, next_id = 101010203, talk_content = "吾名司命，是分给你一半生命，将你从千年的沉睡中唤醒之人。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101010203] = {talk_id = 101010203, group_id = 1010102, type = 5, next_id = 101010204, talk_content = "而你则是被称作青乌的，曾经拯救过世界的救世之人。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
