	[101010205] = {talk_id = 101010205, group_id = 1010102, type = 5, next_id = 0, talk_content = "再一次拯救这个世界吧，青乌。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101020101] = {talk_id = 101020101, group_id = 1010201, type = 5, next_id = 101020102, talk_content = "快，快点，要被追上了！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101020101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101020102] = {talk_id = 101020102, group_id = 1010201, type = 5, next_id = 101020103, talk_content = "我已经尽快了，倒是你明明能飞为什么还要趴在车上面！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101020103] = {talk_id = 101020103, group_id = 1010201, type = 5, next_id = 101020104, talk_content = "我可飞不了这么快！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101020104] = {talk_id = 101020104, group_id = 1010201, type = 5, next_id = 101020105, talk_content = "从那个地方出来以后就一直被人追着，到底是怎么回事。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101020105] = {talk_id = 101020105, group_id = 1010201, type = 5, next_id = 101020106, talk_content = "现在追着我们的是龙。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101020106] = {talk_id = 101020106, group_id = 1010201, type = 5, next_id = 101020107, talk_content = "反正就是某个人的宠物不是吗，我到底哪里惹到他们了！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101020107] = {talk_id = 101020107, group_id = 1010201, type = 5, next_id = 101020108, talk_content = "作为救世之人的你被一两个组织盯上这不是很自然的事情吗！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
