	[101030303] = {talk_id = 101030303, group_id = 1010303, type = 5, next_id = 101030304, talk_content = "缠着你的这个是什么东西？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030304] = {talk_id = 101030304, group_id = 1010303, type = 5, next_id = 101030305, talk_content = "这个叫作淤脉，是气脉能量遭到扭曲堆积而成的一种实体。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030305] = {talk_id = 101030305, group_id = 1010303, type = 5, next_id = 101030306, talk_content = "想来你也听不太懂我顺带解释一下，\n气脉能量是这个星辰世界中流动的庞大能量。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030306] = {talk_id = 101030306, group_id = 1010303, type = 5, next_id = 101030307, talk_content = "称呼其为星辰世界的生命之母也不为过。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030307] = {talk_id = 101030307, group_id = 1010303, type = 5, next_id = 101030308, talk_content = "……还是没有什么头绪，\n但我是明白‘气脉’应该是很了不起的东西了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030308] = {talk_id = 101030308, group_id = 1010303, type = 5, next_id = 101030309, talk_content = "明明是拯救过世界的家伙却忘记了关于世界的一切，我是不是找错人了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
