	[101030401] = {talk_id = 101030401, group_id = 1010304, type = 1, next_id = 101030402, talk_content = "总算是解脱了，呼呼。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {101030401, 101030410, 101030411, 101030412}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101030402] = {talk_id = 101030402, group_id = 1010304, type = 1, next_id = 101030403, talk_content = "只是暂时而已，那条龙应该还在附近寻找我们。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030403] = {talk_id = 101030403, group_id = 1010304, type = 1, next_id = 101030404, talk_content = "司命，你真的不知道我被人追捕的理由吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030404] = {talk_id = 101030404, group_id = 1010304, type = 1, next_id = 101030405, talk_content = "……不知道，我在唤醒你之前连有人监视着那地方也不知道。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030405] = {talk_id = 101030405, group_id = 1010304, type = 1, next_id = 101030406, talk_content = "我只是出于我自己的考虑才将你从那个地方带出来的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030406] = {talk_id = 101030406, group_id = 1010304, type = 1, next_id = 101030407, talk_content = "虽然只是猜测，但我想‘你’应该会知道些什么。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030407] = {talk_id = 101030407, group_id = 1010304, type = 1, next_id = 101030408, talk_content = "你是指失去记忆之前的我对吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030408] = {talk_id = 101030408, group_id = 1010304, type = 1, next_id = 101030409, talk_content = "嗯，毕竟你沉睡的地方也应该是那个组织在管理着的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030409] = {talk_id = 101030409, group_id = 1010304, type = 2, next_id = 0, talk_content = "（也就是说……在醒来之前我一直都沉睡在别人的领地之中。）", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"有没有可能我是他们的同伴？", 101030410}, {"有没有可能我被他们囚禁着。", 101030411}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030410] = {talk_id = 101030410, group_id = 1010304, type = 3, next_id = 101030412, talk_content = "要真是同伴的话就不会有龙追着我们跑了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101030411] = {talk_id = 101030411, group_id = 1010304, type = 3, next_id = 101030412, talk_content = "这个倒有可能……可是囚禁你到底是为了什么呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101030412] = {talk_id = 101030412, group_id = 1010304, type = 1, next_id = 101030413, talk_content = "要得出结论好像有些太早了，\n现在先趁那条龙没追过来先走出这地方如何？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101030413] = {talk_id = 101030413, group_id = 1010304, type = 1, next_id = 101030414, talk_content = "沿着山路走的话应该能到山顶，在高处也能更好观察下一步该往哪里去。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030414] = {talk_id = 101030414, group_id = 1010304, type = 1, next_id = 101030415, talk_content = "下一步……话说你叫醒我的时候说过想让我拯救世界？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030415] = {talk_id = 101030415, group_id = 1010304, type = 1, next_id = 0, talk_content = "那个也等到山顶再说，在这里也很难说明情况呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030501] = {talk_id = 101030501, group_id = 1010305, type = 5, next_id = 101030502, talk_content = "呃……疼，脚扭到了吗。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101030501}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030502] = {talk_id = 101030502, group_id = 1010305, type = 5, next_id = 0, talk_content = "幸好还记得能用的应急药长什么样……去采一些吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030601] = {talk_id = 101030601, group_id = 1010306, type = 4, next_id = 101030602, talk_content = "虽说只能缓解些疼痛，但好歹是能自由走动了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101030601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030602] = {talk_id = 101030602, group_id = 1010306, type = 4, next_id = 0, talk_content = "下次得控制好缓冲的距离。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030701] = {talk_id = 101030701, group_id = 1010307, type = 4, next_id = 101030702, talk_content = "痛，痛，你不能轻点吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101030701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030702] = {talk_id = 101030702, group_id = 1010307, type = 4, next_id = 0, talk_content = "我在救你，忍着点。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030801] = {talk_id = 101030801, group_id = 1010308, type = 4, next_id = 101030802, talk_content = "青乌，从那条独木桥上走过去吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101030801}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030802] = {talk_id = 101030802, group_id = 1010308, type = 4, next_id = 101030803, talk_content = "竟然有桥……是谁在用吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030803] = {talk_id = 101030803, group_id = 1010308, type = 4, next_id = 0, talk_content = "这里看着就不像有人，大概是很久以前留下的东西吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030901] = {talk_id = 101030901, group_id = 1010309, type = 4, next_id = 101030902, talk_content = "注意点走，可别掉下去了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101030901}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101030902] = {talk_id = 101030902, group_id = 1010309, type = 4, next_id = 0, talk_content = "到时候你拉我上来就是。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101031001] = {talk_id = 101031001, group_id = 1010310, type = 5, next_id = 0, talk_content = "", talk_name = "", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = -1, fade_out = false, relevance_id = {101031001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101040101] = {talk_id = 101040101, group_id = 1010401, type = 4, next_id = 101040102, talk_content = "！", talk_name = "怪物", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101040101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040102] = {talk_id = 101040102, group_id = 1010401, type = 4, next_id = 101040103, talk_content = "突然就冲上来了……这是什么，野兽吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040103] = {talk_id = 101040103, group_id = 1010401, type = 4, next_id = 101040104, talk_content = "哇……这里竟然有噬脉生物，\n青乌，是你上场的时候了！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040104] = {talk_id = 101040104, group_id = 1010401, type = 4, next_id = 0, talk_content = "等下可得给我好好说明！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040201] = {talk_id = 101040201, group_id = 1010402, type = 1, next_id = 101040202, talk_content = "这些怪物你说他们叫噬脉生物……和气脉有什么关系吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101040201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040202] = {talk_id = 101040202, group_id = 1010402, type = 1, next_id = 101040203, talk_content = "就是一群专门靠吞噬气脉而生的怪物，你只要简单理解为它们是\n全世界生命的敌人就好了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040203] = {talk_id = 101040203, group_id = 1010402, type = 1, next_id = 101040204, talk_content = "在你沉睡之前也应该和这些怪物战斗过才是。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040204] = {talk_id = 101040204, group_id = 1010402, type = 1, next_id = 101040205, talk_content = "生命的敌人……还是没有太多印象。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040205] = {talk_id = 101040205, group_id = 1010402, type = 1, next_id = 101040206, talk_content = "唉，你就和刚诞生的婴儿一样脑袋空空呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040206] = {talk_id = 101040206, group_id = 1010402, type = 1, next_id = 101040207, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040207] = {talk_id = 101040207, group_id = 1010402, type = 1, next_id = 0, talk_content = "出山以后再想想办法吧，\n毕竟你要是能恢复记忆的话对接下来的旅途也有益呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040301] = {talk_id = 101040301, group_id = 1010403, type = 4, next_id = 101040302, talk_content = "穿过前面这条山道应该\n很快就到山顶了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101040301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040302] = {talk_id = 101040302, group_id = 1010403, type = 4, next_id = 101040303, talk_content = "唉，为什么好不容易找到的\n救世主会失忆呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040303] = {talk_id = 101040303, group_id = 1010403, type = 4, next_id = 101040304, talk_content = "我可没说过自己是什么救世主。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040304] = {talk_id = 101040304, group_id = 1010403, type = 4, next_id = 0, talk_content = "但总之是失忆了，有没有什么方法能帮你回忆起一切呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040401] = {talk_id = 101040401, group_id = 1010404, type = 1, next_id = 101040402, talk_content = "这些怪物你说他们叫噬脉生物……和气脉有什么关系吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {101040401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101040402] = {talk_id = 101040402, group_id = 1010404, type = 1, next_id = 101040403, talk_content = "就是一群专门靠吞噬气脉而生的怪物，你只要简单理解为它们是\n全世界生命的敌人就好了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040403] = {talk_id = 101040403, group_id = 1010404, type = 1, next_id = 101040404, talk_content = "有注意到路上那些半透明的竹子吗，那个就是我一直提到的气脉。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040404] = {talk_id = 101040404, group_id = 1010404, type = 1, next_id = 101040405, talk_content = "按正常来说，气脉应该是挺拔漂亮的竹子，\n但一旦受到噬脉侵蚀，就会开始枯萎……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040405] = {talk_id = 101040405, group_id = 1010404, type = 1, next_id = 101040406, talk_content = "变成那种样子吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040406] = {talk_id = 101040406, group_id = 1010404, type = 1, next_id = 101040407, talk_content = "嗯，那个是遭污染，快要坏死的气脉。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040407] = {talk_id = 101040407, group_id = 1010404, type = 1, next_id = 101040408, talk_content = "坏死了以后会怎么样？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040408] = {talk_id = 101040408, group_id = 1010404, type = 1, next_id = 101040409, talk_content = "就不再发挥功效呗，气脉实际上是一个巨大的包围着星球的网。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040409] = {talk_id = 101040409, group_id = 1010404, type = 1, next_id = 101040410, talk_content = "要是其中有坏死的地方就会出现断点，断点多了，\n那流通的能量就会越来越少。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040410] = {talk_id = 101040410, group_id = 1010404, type = 1, next_id = 101040411, talk_content = "流通的能量变少，赖以生存的生命也就只能随之灭亡了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040411] = {talk_id = 101040411, group_id = 1010404, type = 1, next_id = 101040412, talk_content = "破坏其他生物赖以生存的能量，所以才说那些怪物是生命的敌人……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040412] = {talk_id = 101040412, group_id = 1010404, type = 1, next_id = 101040413, talk_content = "不行，即便听了这些也想不起来……没什么印象。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040413] = {talk_id = 101040413, group_id = 1010404, type = 1, next_id = 101040414, talk_content = "唉，你就和刚诞生的婴儿一样脑袋空空呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040414] = {talk_id = 101040414, group_id = 1010404, type = 1, next_id = 101040415, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040415] = {talk_id = 101040415, group_id = 1010404, type = 1, next_id = 0, talk_content = "出山以后再想想办法吧，\n毕竟你要是能恢复记忆的话对接下来的旅途也有益呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040501] = {talk_id = 101040501, group_id = 1010405, type = 5, next_id = 101040502, talk_content = "又……又来了，青乌，救驾！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101040501}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040502] = {talk_id = 101040502, group_id = 1010405, type = 5, next_id = 0, talk_content = "你把自己当王爷吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040601] = {talk_id = 101040601, group_id = 1010406, type = 4, next_id = 101040602, talk_content = "司命，现在的人类该不会过着很原始的生活吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101040601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040602] = {talk_id = 101040602, group_id = 1010406, type = 4, next_id = 101040603, talk_content = "为什么这么说？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040603] = {talk_id = 101040603, group_id = 1010406, type = 4, next_id = 101040604, talk_content = "因为一路上除了大山就是木桥……\n我该不会穿越到古代了吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040604] = {talk_id = 101040604, group_id = 1010406, type = 4, next_id = 0, talk_content = "放心吧，我没有穿越时空的能力，\n现在的人类也过着很文明的生活。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040701] = {talk_id = 101040701, group_id = 1010407, type = 4, next_id = 0, talk_content = "现在是发挥你真正作用的时候了，青乌！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101040701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040801] = {talk_id = 101040801, group_id = 1010408, type = 4, next_id = 101040802, talk_content = "！", talk_name = "怪物", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101040801}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040802] = {talk_id = 101040802, group_id = 1010408, type = 4, next_id = 101040803, talk_content = "快点，干掉这些噬脉生物！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101040803] = {talk_id = 101040803, group_id = 1010408, type = 4, next_id = 0, talk_content = "等下可得给我好好说明！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050101] = {talk_id = 101050101, group_id = 1010501, type = 1, next_id = 101050102, talk_content = "怎么停下来了？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {101050101, 101050113}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050102] = {talk_id = 101050102, group_id = 1010501, type = 1, next_id = 101050103, talk_content = "路上也有不少这样的东西，这些到底是？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050103] = {talk_id = 101050103, group_id = 1010501, type = 1, next_id = 101050104, talk_content = "我忘记说了吗，这个就是刚才提到的‘气脉’。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050104] = {talk_id = 101050104, group_id = 1010501, type = 1, next_id = 101050105, talk_content = "它们常常以这样的形态出现在土地之上哦。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050105] = {talk_id = 101050105, group_id = 1010501, type = 1, next_id = 101050106, talk_content = "气脉之间形态差异挺大呢。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050106] = {talk_id = 101050106, group_id = 1010501, type = 1, next_id = 101050107, talk_content = "噢，那个是遭污染，快要坏死的气脉。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050107] = {talk_id = 101050107, group_id = 1010501, type = 1, next_id = 101050108, talk_content = "坏死了以后会怎么样？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050108] = {talk_id = 101050108, group_id = 1010501, type = 1, next_id = 101050109, talk_content = "就不再发挥功效呗，气脉实际上是一个巨大的包围着星球的网。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050109] = {talk_id = 101050109, group_id = 1010501, type = 1, next_id = 101050110, talk_content = "要是其中有坏死的地方就会出现断点，断点多了，那流通的能量就会越来越少。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050110] = {talk_id = 101050110, group_id = 1010501, type = 1, next_id = 101050111, talk_content = "流通的能量越来越少，那赖以生存的生命也就只能随之灭亡了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050111] = {talk_id = 101050111, group_id = 1010501, type = 1, next_id = 101050112, talk_content = "这不是很危险吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050112] = {talk_id = 101050112, group_id = 1010501, type = 2, next_id = 0, talk_content = "当然很危险，但气脉的坏死是不可逆的，人类能做的大概就只有延缓了吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"（伸出手）", 101050113}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050113] = {talk_id = 101050113, group_id = 1010501, type = 3, next_id = 101050114, talk_content = "等等，你刚刚做了什么，为什么要坏死的气脉突然就回复过来了？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050114] = {talk_id = 101050114, group_id = 1010501, type = 3, next_id = 101050115, talk_content = "不清楚……但是我总觉得自己应该能做些什么。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050115] = {talk_id = 101050115, group_id = 1010501, type = 3, next_id = 0, talk_content = "（这就是救世之人……青乌的力量吗？）", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101050201] = {talk_id = 101050201, group_id = 1010502, type = 5, next_id = 0, talk_content = "", talk_name = "", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 1, fade_out = false, relevance_id = {101050201}, addition_relevance_id = {101060101}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101060101] = {talk_id = 101060101, group_id = 1010601, type = 5, next_id = 101060102, talk_content = "这里有把剑哎……是谁插在这个地方的吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 0, fade_out = true, relevance_id = {101060101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101060102] = {talk_id = 101060102, group_id = 1010601, type = 5, next_id = 101060103, talk_content = "唔，只是普通货呀。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101060103] = {talk_id = 101060103, group_id = 1010601, type = 5, next_id = 101060104, talk_content = "比没有的强，这下战斗起来就更称手了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101060104] = {talk_id = 101060104, group_id = 1010601, type = 5, next_id = 101060105, talk_content = "说来你最初记得的除了名字以外还有自己的武器是双剑呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101060105] = {talk_id = 101060105, group_id = 1010601, type = 5, next_id = 0, talk_content = "只能说幸好记得战斗的方法，不然早就被人捉住了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
