	[101062403] = {talk_id = 101062403, group_id = 1010624, type = 1, next_id = 101062404, talk_content = "那是因为我有让你马上变强的方法。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062404] = {talk_id = 101062404, group_id = 1010624, type = 1, next_id = 101062405, talk_content = "该不会是要在这里教我用什么必杀技吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062405] = {talk_id = 101062405, group_id = 1010624, type = 1, next_id = 101062406, talk_content = "真有那种东西我自己上不就好了，\n我所说的是我能提升你的基础实力。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062406] = {talk_id = 101062406, group_id = 1010624, type = 1, next_id = 101062407, talk_content = "对于其他人来说，提升实力的方式或许就是日夜苦练，日积月累。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062407] = {talk_id = 101062407, group_id = 1010624, type = 2, next_id = 0, talk_content = "但是对于拥有我一半生命的你来说，变强的方式还有一个。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"（那是什么？）", 101062408}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062408] = {talk_id = 101062408, group_id = 1010624, type = 3, next_id = 101062409, talk_content = "那就是吸收敌人的‘残念’，所谓的念……呃", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062409] = {talk_id = 101062409, group_id = 1010624, type = 3, next_id = 101062410, talk_content = "总之那个是一瞬间产生的代表了情绪的能量，而物体被消灭时所产生的念，往往是浓度最高的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062410] = {talk_id = 101062410, group_id = 1010624, type = 3, next_id = 101062411, talk_content = "只要吸收了那个的话，那就算不去特意做什么努力你的能力也能得到进步。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062411] = {talk_id = 101062411, group_id = 1010624, type = 3, next_id = 0, talk_content = "刚好在路上我有收起来几个这样的东西，你就按我说的试试吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062501] = {talk_id = 101062501, group_id = 1010625, type = 1, next_id = 101062502, talk_content = "吸收这样的东西真的没问题吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {101062501}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[101062502] = {talk_id = 101062502, group_id = 1010625, type = 1, next_id = 101062503, talk_content = "我还等着你拯救世界呢，怎么可能会害你呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062503] = {talk_id = 101062503, group_id = 1010625, type = 1, next_id = 0, talk_content = "继续往上吧，青乌。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062601] = {talk_id = 101062601, group_id = 1010626, type = 4, next_id = 101062602, talk_content = "所以刚刚捡到的武器怎样，好使吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101062601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062602] = {talk_id = 101062602, group_id = 1010626, type = 4, next_id = 101062603, talk_content = "嗯，比原本带着的要好。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062603] = {talk_id = 101062603, group_id = 1010626, type = 4, next_id = 101062604, talk_content = "虽然在我看来都是废铁就是了，之后有时间我们搞把更好的吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062604] = {talk_id = 101062604, group_id = 1010626, type = 4, next_id = 0, talk_content = "真能搞到的话是再好不过了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062701] = {talk_id = 101062701, group_id = 1010627, type = 4, next_id = 0, talk_content = "很好。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101062701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062801] = {talk_id = 101062801, group_id = 1010628, type = 4, next_id = 0, talk_content = "信念技……看来你也已经习惯\n这个了呢。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101062801}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062901] = {talk_id = 101062901, group_id = 1010629, type = 4, next_id = 101062902, talk_content = "接下来就是关于弱点的复习了。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101062901}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062902] = {talk_id = 101062902, group_id = 1010629, type = 4, next_id = 101062903, talk_content = "技能可大量增长弱点，当弱点的值到达临界点……", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062903] = {talk_id = 101062903, group_id = 1010629, type = 4, next_id = 101062904, talk_content = "敌人就会露出破绽。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062904] = {talk_id = 101062904, group_id = 1010629, type = 4, next_id = 101062905, talk_content = "然后就可以释放五行绝技了。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101062905] = {talk_id = 101062905, group_id = 1010629, type = 4, next_id = 0, talk_content = "试试看。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063001] = {talk_id = 101063001, group_id = 1010630, type = 4, next_id = 0, talk_content = "可以，就是这个感觉。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063101] = {talk_id = 101063101, group_id = 1010631, type = 4, next_id = 101063102, talk_content = "释放五行绝技以后有感觉到别的东西流进体内了吧？", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063102] = {talk_id = 101063102, group_id = 1010631, type = 4, next_id = 101063103, talk_content = "是说月相吧……", talk_name = "叙幕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063103] = {talk_id = 101063103, group_id = 1010631, type = 4, next_id = 101063104, talk_content = "月相和日相一样能被用来释放技能。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063104] = {talk_id = 101063104, group_id = 1010631, type = 4, next_id = 0, talk_content = "但和日相不同，月相是临时的，也只能通过刚才那样释放绝技来获得。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063201] = {talk_id = 101063201, group_id = 1010632, type = 4, next_id = 0, talk_content = "不错。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063301] = {talk_id = 101063301, group_id = 1010633, type = 4, next_id = 0, talk_content = "使用月相的手段你也熟练掌握了呢。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063401] = {talk_id = 101063401, group_id = 1010634, type = 4, next_id = 101063402, talk_content = "注意到了吧，释放技能就可以让你获得‘炎印’。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063402] = {talk_id = 101063402, group_id = 1010634, type = 4, next_id = 101063403, talk_content = "‘炎印’？", talk_name = "叙幕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063403] = {talk_id = 101063403, group_id = 1010634, type = 4, next_id = 101063404, talk_content = "没错，每个炎印都能让你带来伤害加成。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063404] = {talk_id = 101063404, group_id = 1010634, type = 4, next_id = 101063405, talk_content = "当拥有三颗炎印的时候，就可以施展‘信念技’。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063405] = {talk_id = 101063405, group_id = 1010634, type = 4, next_id = 0, talk_content = "相比起技能和普通攻击，‘信念技’能造成更大的伤害。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063501] = {talk_id = 101063501, group_id = 1010635, type = 4, next_id = 101063502, talk_content = "话说，我记得某人好像说过日相什么什么的……", talk_name = "叙幕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063501}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063502] = {talk_id = 101063502, group_id = 1010635, type = 4, next_id = 0, talk_content = "对，是没有日相的情况下\n不要被人打中……", talk_name = "叙幕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063601] = {talk_id = 101063601, group_id = 1010636, type = 4, next_id = 101063602, talk_content = "这种感觉是……", talk_name = "叙幕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063602] = {talk_id = 101063602, group_id = 1010636, type = 4, next_id = 0, talk_content = "在没有日相的情况下，被敌人击中就会陷入这种状态，好好记住吧。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063701] = {talk_id = 101063701, group_id = 1010637, type = 4, next_id = 0, talk_content = "注意这里。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063801] = {talk_id = 101063801, group_id = 1010638, type = 4, next_id = 101063802, talk_content = "闪避就到这里吧。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {101063801}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063802] = {talk_id = 101063802, group_id = 1010638, type = 4, next_id = 101063803, talk_content = "防御的方式还有最后一种，那就是‘跳’。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101063803] = {talk_id = 101063803, group_id = 1010638, type = 4, next_id = 101063804, talk_content = "我不太习惯那个。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
