	[101080103] = {talk_id = 101080103, group_id = 1010801, type = 4, next_id = 0, talk_content = "力量用过度了吧，趁没有追兵赶紧离开这个地方吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
