	[101071007] = {talk_id = 101071007, group_id = 1010710, type = 5, next_id = 101071008, talk_content = "很敏锐呢……不过现在也无所谓了。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101071008] = {talk_id = 101071008, group_id = 1010710, type = 5, next_id = 101071009, talk_content = "青乌，我们会如此相见就代表我们的抗争失败了，但你还活着，这比什么都好。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[101071009] = {talk_id = 101071009, group_id = 1010710, type = 5, next_id = 101071010, talk_content = "握紧这块玉吧，这是你与月相仍然连接的证明。", talk_name = "离歌", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
