	[102010104] = {talk_id = 102010104, group_id = 1020101, type = 1, next_id = 102010105, talk_content = "听上去挺危险的，不会往下掉吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010105] = {talk_id = 102010105, group_id = 1020101, type = 1, next_id = 102010106, talk_content = "担心什么，你要是不小心掉下去了那我再把你拉回来就是。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010106] = {talk_id = 102010106, group_id = 1020101, type = 1, next_id = 0, talk_content = "总之把东西拿好，起飞！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010201] = {talk_id = 102010201, group_id = 1020102, type = 4, next_id = 102010202, talk_content = "还真飞起来了……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102010201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010202] = {talk_id = 102010202, group_id = 1020102, type = 4, next_id = 0, talk_content = "哼哼，这个羽鸢可是我费了很多工夫搞回来的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010301] = {talk_id = 102010301, group_id = 1020103, type = 4, next_id = 102010302, talk_content = "要平衡还挺难。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102010301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010302] = {talk_id = 102010302, group_id = 1020103, type = 4, next_id = 0, talk_content = "你捉紧就好了，目标是钟悬噢！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010401] = {talk_id = 102010401, group_id = 1020104, type = 1, next_id = 102010402, talk_content = "接下来要怎么办，司命。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {102010401, 102010405, 102010407}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102010402] = {talk_id = 102010402, group_id = 1020104, type = 1, next_id = 102010403, talk_content = "我说了要敲钟吧，只要敲响了钟就能与附近的气脉连接，\n知道我们到底身在何处了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010403] = {talk_id = 102010403, group_id = 1020104, type = 1, next_id = 102010404, talk_content = "还有这么便利的东西，这个是谁做出来的？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010404] = {talk_id = 102010404, group_id = 1020104, type = 2, next_id = 0, talk_content = "是一个很自大的人类，姓甚名谁我不记得了，毕竟是好几百年前的事情。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"你到底活多久了。", 102010405}, {"……现在还能用吗？", 102010407}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010405] = {talk_id = 102010405, group_id = 1020104, type = 3, next_id = 102010406, talk_content = "过了一定年月以后就没数过了，记这些事情也没什么用。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010406] = {talk_id = 102010406, group_id = 1020104, type = 3, next_id = 0, talk_content = "倒是快点敲钟吧，不然那个组织的人又要追过来了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010407] = {talk_id = 102010407, group_id = 1020104, type = 3, next_id = 102010408, talk_content = "这个不是复杂机械，只是个向气脉告拜的祭坛而已，只要形式满足，即便再过多少年月也能使用。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010408] = {talk_id = 102010408, group_id = 1020104, type = 3, next_id = 0, talk_content = "倒是快点敲钟吧，不然那个组织的人又要追过来了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010501] = {talk_id = 102010501, group_id = 1020105, type = 1, next_id = 102010502, talk_content = "有种豁然开朗的感觉……真奇妙。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = true, fade_in = 1, fade_out = true, relevance_id = {102010501, 102010514}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102010502] = {talk_id = 102010502, group_id = 1020105, type = 1, next_id = 102010503, talk_content = "好，那接下来就朝着太阳的方向出发吧！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010503] = {talk_id = 102010503, group_id = 1020105, type = 1, next_id = 102010504, talk_content = "我没答应过那个。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010504] = {talk_id = 102010504, group_id = 1020105, type = 1, next_id = 102010505, talk_content = "？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010505] = {talk_id = 102010505, group_id = 1020105, type = 1, next_id = 102010506, talk_content = "世界如何，太阳如何另说。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010506] = {talk_id = 102010506, group_id = 1020105, type = 1, next_id = 102010507, talk_content = "但对于我来说，当务之急并不是什么拯救世界，\n而是搞懂自己是谁。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010507] = {talk_id = 102010507, group_id = 1020105, type = 1, next_id = 102010508, talk_content = "搞懂自己为什么会被人当成猎物追捕。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010508] = {talk_id = 102010508, group_id = 1020105, type = 1, next_id = 102010509, talk_content = "……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010509] = {talk_id = 102010509, group_id = 1020105, type = 1, next_id = 102010510, talk_content = "你也好，离歌那个组织也好，你们都似乎想利用我做些什么事情。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010510] = {talk_id = 102010510, group_id = 1020105, type = 1, next_id = 102010511, talk_content = "既然现在有偷闲的时间，那应该能跟我好好说说吧，\n我到底是什么人。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010511] = {talk_id = 102010511, group_id = 1020105, type = 1, next_id = 102010512, talk_content = "我说了很多遍了呀，你是青乌，是救世之人。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010512] = {talk_id = 102010512, group_id = 1020105, type = 1, next_id = 102010513, talk_content = "你这叫糊弄，就算我是救世之人也得有个前因后果吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010513] = {talk_id = 102010513, group_id = 1020105, type = 2, next_id = 0, talk_content = "别这样看着我，我什么都不知道。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"你该不会要说你也失忆了吧？", 102010514}, {"不知道却把我叫醒吗？", 102010514}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010514] = {talk_id = 102010514, group_id = 1020105, type = 3, next_id = 102010515, talk_content = "现在的我的确不知道你的‘前因后果’，但要是能变回真体的话大概就能记起关于你的一切了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010515] = {talk_id = 102010515, group_id = 1020105, type = 3, next_id = 102010516, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010516] = {talk_id = 102010516, group_id = 1020105, type = 3, next_id = 102010517, talk_content = "要怀疑我就尽管怀疑好了，但你可要记得是我把你沉睡中唤醒，\n带你自由的人。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010517] = {talk_id = 102010517, group_id = 1020105, type = 3, next_id = 102010518, talk_content = "一路上我也有为你解疑，为你寻回记忆感到喜悦，\n要害你的人可不会这样吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010518] = {talk_id = 102010518, group_id = 1020105, type = 3, next_id = 102010519, talk_content = "……这点我的确没法反驳。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010519] = {talk_id = 102010519, group_id = 1020105, type = 3, next_id = 102010520, talk_content = "实际你现在除了依靠我就没有别的好办法了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010520] = {talk_id = 102010520, group_id = 1020105, type = 3, next_id = 102010521, talk_content = "你就不能在我听不见的地方说这句话。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010521] = {talk_id = 102010521, group_id = 1020105, type = 3, next_id = 102010522, talk_content = "这叫诚实。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010522] = {talk_id = 102010522, group_id = 1020105, type = 3, next_id = 102010523, talk_content = "啾！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010523] = {talk_id = 102010523, group_id = 1020105, type = 3, next_id = 102010524, talk_content = "呃，瘟神出现了！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010524] = {talk_id = 102010524, group_id = 1020105, type = 3, next_id = 102010525, talk_content = "啾！", talk_name = "脉灵", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010525] = {talk_id = 102010525, group_id = 1020105, type = 3, next_id = 102010526, talk_content = "这个可比你可爱多了，话说它好像在传达些什么。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010526] = {talk_id = 102010526, group_id = 1020105, type = 3, next_id = 102010527, talk_content = "啾！！！", talk_name = "脉灵", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010527] = {talk_id = 102010527, group_id = 1020105, type = 3, next_id = 102010528, talk_content = "好像在往那边指哎，有什么吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010528] = {talk_id = 102010528, group_id = 1020105, type = 3, next_id = 102010529, talk_content = "那边好像有个小基地，不对……据点？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102010529] = {talk_id = 102010529, group_id = 1020105, type = 3, next_id = 0, talk_content = "剩下的话之后再说，我们去看看吧，司命。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030101] = {talk_id = 102030101, group_id = 1020301, type = 4, next_id = 102030102, talk_content = "我觉得你这人是带点歧视的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102030101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030102] = {talk_id = 102030102, group_id = 1020301, type = 4, next_id = 102030103, talk_content = "怎讲。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030103] = {talk_id = 102030103, group_id = 1020301, type = 4, next_id = 102030104, talk_content = "我拜托你的时候可没见\n你有刚才那么爽快。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030104] = {talk_id = 102030104, group_id = 1020301, type = 4, next_id = 102030105, talk_content = "要不你也换个讨喜点的样子。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030105] = {talk_id = 102030105, group_id = 1020301, type = 4, next_id = 0, talk_content = "别把我尊贵的玉体和那种烂大街的货\n相提并论！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030201] = {talk_id = 102030201, group_id = 1020302, type = 1, next_id = 102030202, talk_content = "呼，一路这么走到现在，总算是有点‘文明’的感觉了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102030201, 102030208, 102030210, 102030212}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102030202] = {talk_id = 102030202, group_id = 1020302, type = 1, next_id = 102030203, talk_content = "毕竟我们一直都在走崎岖的山路，碰不见人也是正常。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030203] = {talk_id = 102030203, group_id = 1020302, type = 1, next_id = 102030204, talk_content = "不过在这里面的似乎并不是人呢。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030204] = {talk_id = 102030204, group_id = 1020302, type = 1, next_id = 102030205, talk_content = "奇怪，可我明明闻到了人类的味道。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030205] = {talk_id = 102030205, group_id = 1020302, type = 1, next_id = 102030206, talk_content = "我还是第一次知道你有这种特异功能。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030206] = {talk_id = 102030206, group_id = 1020302, type = 1, next_id = 102030207, talk_content = "以后你还会知道更多的，\n那小瘟神大概就是想让我们解决一下这个状况。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030207] = {talk_id = 102030207, group_id = 1020302, type = 2, next_id = 0, talk_content = "好，青乌，接下来就啪啪啪地几下解决敌人吧！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"怎么突然变积极了？", 102030208}, {"你有什么计划吗？", 102030210}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030208] = {talk_id = 102030208, group_id = 1020302, type = 3, next_id = 102030209, talk_content = "小善通大善，培养一下你对于拯救世界的使命感也没坏吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030209] = {talk_id = 102030209, group_id = 1020302, type = 3, next_id = 102030212, talk_content = "这话倒是让我的积极性下降了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030210] = {talk_id = 102030210, group_id = 1020302, type = 3, next_id = 102030211, talk_content = "啪啪啪地解决敌人就好了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030211] = {talk_id = 102030211, group_id = 1020302, type = 3, next_id = 102030212, talk_content = "讲废话一流啊，司命。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030212] = {talk_id = 102030212, group_id = 1020302, type = 1, next_id = 102030213, talk_content = "怪话放一边，贸然冲进去肯定要吃苦头，\n所以现在就是用佩从的好时机了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030213] = {talk_id = 102030213, group_id = 1020302, type = 1, next_id = 102030214, talk_content = "又是我没听过的词语。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030214] = {talk_id = 102030214, group_id = 1020302, type = 1, next_id = 102030215, talk_content = "就是你之前拾得的玉佩，那个是生命的记录，灵魂的分魂，脉者们可以使用这个丰富自己的作战手段，然后……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030215] = {talk_id = 102030215, group_id = 1020302, type = 1, next_id = 102030216, talk_content = "简单点。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030216] = {talk_id = 102030216, group_id = 1020302, type = 1, next_id = 102030217, talk_content = "你只要把能量灌入其中，就能把那个离歌的幻影\n叫出来让她帮你解决敌人了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030217] = {talk_id = 102030217, group_id = 1020302, type = 1, next_id = 102030218, talk_content = "这样没危险吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030218] = {talk_id = 102030218, group_id = 1020302, type = 1, next_id = 102030219, talk_content = "叫出来的佩从并没有意识，只是能量的瞬间具象而已。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030219] = {talk_id = 102030219, group_id = 1020302, type = 1, next_id = 0, talk_content = "百闻不如一见，我教你先用一次吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030301] = {talk_id = 102030301, group_id = 1020303, type = 4, next_id = 102030302, talk_content = "青乌，人都在那里面，\n那里气味最浓了！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102030301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030302] = {talk_id = 102030302, group_id = 1020303, type = 4, next_id = 102030303, talk_content = "这门能直接开吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030303] = {talk_id = 102030303, group_id = 1020303, type = 4, next_id = 0, talk_content = "总会有办法的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030401] = {talk_id = 102030401, group_id = 1020304, type = 1, next_id = 102030402, talk_content = "得，得救了……", talk_name = "被救者", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 1, fade_out = true, relevance_id = {102030401, 102030406, 102030409, 102030412, 102030414, 102030416}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102030402] = {talk_id = 102030402, group_id = 1020304, type = 1, next_id = 102030403, talk_content = "外面真的没有噬脉生物了吗？", talk_name = "被救者", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030403] = {talk_id = 102030403, group_id = 1020304, type = 1, next_id = 102030404, talk_content = "看来是安全了。", talk_name = "被救者", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030404] = {talk_id = 102030404, group_id = 1020304, type = 1, next_id = 102030405, talk_content = "打开门以后人一下子就涌出来了呢，看来他们并不是被困，\n而是躲在里面的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030405] = {talk_id = 102030405, group_id = 1020304, type = 2, next_id = 0, talk_content = "感谢两位，我的名字叫温罗，敢问义人的名字是？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"（告知名字）", 102030406}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030406] = {talk_id = 102030406, group_id = 1020304, type = 3, next_id = 102030407, talk_content = "叫我青乌就好，这只鸟也是这么叫的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030407] = {talk_id = 102030407, group_id = 1020304, type = 3, next_id = 102030408, talk_content = "话说回来，这里的状况到底是？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030408] = {talk_id = 102030408, group_id = 1020304, type = 2, next_id = 0, talk_content = "如你所见，我们的据点遭到怪物袭击，由于没有像您这样的脉者在场，我们只好躲藏在仓库之中等候救援。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"脉者……？", 102030409}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030409] = {talk_id = 102030409, group_id = 1020304, type = 3, next_id = 102030410, talk_content = "就是能使用特殊力量的人的称呼，当然也只有人类之间会这么叫而已。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030410] = {talk_id = 102030410, group_id = 1020304, type = 3, next_id = 102030411, talk_content = "也就是说其他人并不能像我那样让剑上带火吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030411] = {talk_id = 102030411, group_id = 1020304, type = 2, next_id = 0, talk_content = "那当然不行，这可是受到天地眷顾，被气脉选上的人才能拥有的力量。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"听着很玄乎。", 102030412}, {"那离歌也是被选上的？", 102030414}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030412] = {talk_id = 102030412, group_id = 1020304, type = 3, next_id = 102030413, talk_content = "也没那么玄乎，你就当个人体质就好，脉者的身体都会有一些特别的特征，常人则没有。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030413] = {talk_id = 102030413, group_id = 1020304, type = 3, next_id = 102030416, talk_content = "用这个可以简单区分对面的人类是不是脉者噢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030414] = {talk_id = 102030414, group_id = 1020304, type = 3, next_id = 102030415, talk_content = "嗯，毕竟被气脉选上与个人的道德无关，恶用力量的大有人在。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030415] = {talk_id = 102030415, group_id = 1020304, type = 3, next_id = 102030416, talk_content = "力量与道德无关，这个道理我倒是能明白呢。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030416] = {talk_id = 102030416, group_id = 1020304, type = 1, next_id = 102030417, talk_content = "呃，两位义人……你们聊好了吗？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030417] = {talk_id = 102030417, group_id = 1020304, type = 1, next_id = 102030418, talk_content = "啊……抱歉，刚刚因为听到了不认识的词语所以走了神。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030418] = {talk_id = 102030418, group_id = 1020304, type = 1, next_id = 102030419, talk_content = "不要紧，倒是义人您竟然会不知道脉者……", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030419] = {talk_id = 102030419, group_id = 1020304, type = 1, next_id = 102030420, talk_content = "这家伙是乡下来的，你就不要介意这么多了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030420] = {talk_id = 102030420, group_id = 1020304, type = 1, next_id = 102030421, talk_content = "谁是乡下来的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030421] = {talk_id = 102030421, group_id = 1020304, type = 1, next_id = 102030422, talk_content = "这里先闭嘴，别让不认识的人知道太多你的情报。（小声）", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030422] = {talk_id = 102030422, group_id = 1020304, type = 1, next_id = 102030423, talk_content = "这应该在我把青乌二字报出来之前说。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030423] = {talk_id = 102030423, group_id = 1020304, type = 1, next_id = 102030424, talk_content = "呃，假若是从外面来的话那义人们的目标肯定到天柜城没错吧？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030424] = {talk_id = 102030424, group_id = 1020304, type = 1, next_id = 102030425, talk_content = "你说的天柜城是指的天上的那个吗？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030425] = {talk_id = 102030425, group_id = 1020304, type = 1, next_id = 102030426, talk_content = "是的，呃，难道你们只是路过？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030426] = {talk_id = 102030426, group_id = 1020304, type = 1, next_id = 102030427, talk_content = "不，我现在的确想去看看……所以该怎么才能到上面去？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030427] = {talk_id = 102030427, group_id = 1020304, type = 1, next_id = 102030428, talk_content = "需要取个通行许可，这附近有个小镇熙来，在熙来中有一个特别显眼的建筑，名为维安司。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030428] = {talk_id = 102030428, group_id = 1020304, type = 1, next_id = 102030429, talk_content = "我会提前和那边联系说你们两位会到那边去，详细的手续事宜就请你们到那边再确认吧。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030429] = {talk_id = 102030429, group_id = 1020304, type = 1, next_id = 102030430, talk_content = "也就是说你会帮我们打点吗，不会被赶出来吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030430] = {talk_id = 102030430, group_id = 1020304, type = 1, next_id = 102030431, talk_content = "那当然，毕竟你们可是救命恩人呢。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030431] = {talk_id = 102030431, group_id = 1020304, type = 1, next_id = 102030432, talk_content = "这还差不多，另外再给点钱……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030432] = {talk_id = 102030432, group_id = 1020304, type = 1, next_id = 0, talk_content = "别贪得无厌。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030501] = {talk_id = 102030501, group_id = 1020305, type = 1, next_id = 102030502, talk_content = "话说回来，你们之后要怎么回去，路上也有噬脉生物徘徊。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102030501}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030502] = {talk_id = 102030502, group_id = 1020305, type = 1, next_id = 102030503, talk_content = "不用担心，我们知道安全回去的道路，就不用劳烦义人你们了。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030503] = {talk_id = 102030503, group_id = 1020305, type = 1, next_id = 102030504, talk_content = "（别没事找事，她很明显就是不想再麻烦我们了你不知道吗？）", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030504] = {talk_id = 102030504, group_id = 1020305, type = 1, next_id = 102030505, talk_content = "之前不才说要培养我的使命感云云的吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030505] = {talk_id = 102030505, group_id = 1020305, type = 1, next_id = 0, talk_content = "呃……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030601] = {talk_id = 102030601, group_id = 1020306, type = 4, next_id = 102030602, talk_content = "话说回来，下面有几只小从士，拿那个来练练手吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102030601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030602] = {talk_id = 102030602, group_id = 1020306, type = 4, next_id = 0, talk_content = "练手？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030701] = {talk_id = 102030701, group_id = 1020307, type = 1, next_id = 102030702, talk_content = "这里应该就不会引起警觉了，青乌，接下来我就教你使用佩从的方法吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 1, fade_out = true, relevance_id = {102030701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102030702] = {talk_id = 102030702, group_id = 1020307, type = 1, next_id = 102030703, talk_content = "又是我没听过的词语。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030703] = {talk_id = 102030703, group_id = 1020307, type = 1, next_id = 102030704, talk_content = "就是你之前拾得的玉佩，那个是生命的记录，灵魂的分魂，脉者们可以使用这个丰富自己的作战手段，然后……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030704] = {talk_id = 102030704, group_id = 1020307, type = 1, next_id = 102030705, talk_content = "简单点。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030705] = {talk_id = 102030705, group_id = 1020307, type = 1, next_id = 102030706, talk_content = "你只要把能量灌入其中，就能把那个离歌的幻影\n叫出来让她帮你解决敌人了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030706] = {talk_id = 102030706, group_id = 1020307, type = 1, next_id = 102030707, talk_content = "这样没危险吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030707] = {talk_id = 102030707, group_id = 1020307, type = 1, next_id = 102030708, talk_content = "叫出来的佩从并没有意识，只是能量的瞬间具象而已。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030708] = {talk_id = 102030708, group_id = 1020307, type = 1, next_id = 0, talk_content = "百闻不如一见，你先按照我说的去做吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030801] = {talk_id = 102030801, group_id = 1020308, type = 1, next_id = 102030802, talk_content = "呼，一路这么走到现在，总算是有点‘文明’的感觉了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 1, fade_out = true, relevance_id = {102030801, 102030808, 102030810}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102030802] = {talk_id = 102030802, group_id = 1020308, type = 1, next_id = 102030803, talk_content = "毕竟我们一直都在走崎岖的山路，碰不见人也是正常。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030803] = {talk_id = 102030803, group_id = 1020308, type = 1, next_id = 102030804, talk_content = "不过在这里面的似乎并不是人呢。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030804] = {talk_id = 102030804, group_id = 1020308, type = 1, next_id = 102030805, talk_content = "奇怪，可我明明闻到了人类的味道。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030805] = {talk_id = 102030805, group_id = 1020308, type = 1, next_id = 102030806, talk_content = "我还是第一次知道你有这种特异功能。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030806] = {talk_id = 102030806, group_id = 1020308, type = 1, next_id = 102030807, talk_content = "以后你还会知道更多的，\n那小瘟神大概就是想让我们解决一下这个状况。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030807] = {talk_id = 102030807, group_id = 1020308, type = 2, next_id = 0, talk_content = "好，青乌，接下来就啪啪啪地几下解决敌人吧！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"怎么突然变积极了？", 102030808}, {"你有什么计划吗？", 102030810}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030808] = {talk_id = 102030808, group_id = 1020308, type = 3, next_id = 102030809, talk_content = "小善通大善，培养一下你对于拯救世界的使命感也没坏吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030809] = {talk_id = 102030809, group_id = 1020308, type = 3, next_id = 0, talk_content = "这话倒是让我的积极性下降了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030810] = {talk_id = 102030810, group_id = 1020308, type = 3, next_id = 102030811, talk_content = "啪啪啪地解决敌人就好了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030811] = {talk_id = 102030811, group_id = 1020308, type = 3, next_id = 0, talk_content = "讲废话一流啊，司命。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030901] = {talk_id = 102030901, group_id = 1020309, type = 4, next_id = 102030902, talk_content = "没想到那个玉佩还能干这种事。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102030901}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030902] = {talk_id = 102030902, group_id = 1020309, type = 4, next_id = 102030903, talk_content = "佩从能干的事还有很多，要是有那个意思多收集些也不是坏事。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102030903] = {talk_id = 102030903, group_id = 1020309, type = 4, next_id = 0, talk_content = "倒是脉灵刚刚指的地方的确有什么奇怪的东西，我们去看看吧，青乌。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040101] = {talk_id = 102040101, group_id = 1020401, type = 4, next_id = 102040102, talk_content = "青乌，你有什么心事吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102040101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040102] = {talk_id = 102040102, group_id = 1020401, type = 4, next_id = 102040103, talk_content = "一切都是如此熟悉又陌生。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040103] = {talk_id = 102040103, group_id = 1020401, type = 4, next_id = 102040104, talk_content = "？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040104] = {talk_id = 102040104, group_id = 1020401, type = 4, next_id = 102040105, talk_content = "我是说现在的世界，我能够明白很多\n概念，但又有很多概念是我不认得的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040105] = {talk_id = 102040105, group_id = 1020401, type = 4, next_id = 102040106, talk_content = "（就彷佛……我来到了另一个世界一般。）", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040106] = {talk_id = 102040106, group_id = 1020401, type = 4, next_id = 102040107, talk_content = "无论如何，得先想办法回忆起一切。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040107] = {talk_id = 102040107, group_id = 1020401, type = 4, next_id = 0, talk_content = "可别忘了还有拯救世界！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040201] = {talk_id = 102040201, group_id = 1020402, type = 1, next_id = 102040202, talk_content = "到处都是人类的气味呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 1, fade_out = true, relevance_id = {102040201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102040202] = {talk_id = 102040202, group_id = 1020402, type = 1, next_id = 102040203, talk_content = "怎样，青乌你对这个有什么感触吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040203] = {talk_id = 102040203, group_id = 1020402, type = 1, next_id = 102040204, talk_content = "这和我认识中的城市没什么差异，除了街上有些奇怪的装置。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040204] = {talk_id = 102040204, group_id = 1020402, type = 1, next_id = 102040205, talk_content = "那些是气脉的传输管道，现在的人类都是靠这个来维持生活的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040205] = {talk_id = 102040205, group_id = 1020402, type = 1, next_id = 102040206, talk_content = "气脉……也就是说那些怪物需要这个，然后人类也需要这个。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040206] = {talk_id = 102040206, group_id = 1020402, type = 1, next_id = 102040207, talk_content = "是全世界都需要这个，虽然没有什么感知，\n但你我的身体里面都存在气脉哦。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040207] = {talk_id = 102040207, group_id = 1020402, type = 1, next_id = 102040208, talk_content = "话说回来，你一个动物为什么会对人类社会的事情这么清楚？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040208] = {talk_id = 102040208, group_id = 1020402, type = 1, next_id = 102040209, talk_content = "这就是活得久的好处了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040209] = {talk_id = 102040209, group_id = 1020402, type = 1, next_id = 102040210, talk_content = "青乌，在城市里可以调查到很多信息，\n但是在那之前先到那个温罗说的维安司去吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040210] = {talk_id = 102040210, group_id = 1020402, type = 1, next_id = 102040211, talk_content = "不搞点钱可没法在城里自由行动呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040211] = {talk_id = 102040211, group_id = 1020402, type = 1, next_id = 0, talk_content = "这一点我只能同意了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040301] = {talk_id = 102040301, group_id = 1020403, type = 4, next_id = 102040302, talk_content = "城里挺和平的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102040301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040302] = {talk_id = 102040302, group_id = 1020403, type = 4, next_id = 102040303, talk_content = "的确是这样。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040303] = {talk_id = 102040303, group_id = 1020403, type = 4, next_id = 0, talk_content = "（所以真的有必要拯救世界吗？）", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040401] = {talk_id = 102040401, group_id = 1020404, type = 5, next_id = 102040402, talk_content = "是佩从玉……从人身上落下来还真是少见。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102040401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040402] = {talk_id = 102040402, group_id = 1020404, type = 5, next_id = 0, talk_content = "喂，青乌，去把那个捡起来吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040501] = {talk_id = 102040501, group_id = 1020405, type = 1, next_id = 102040502, talk_content = "两位义人，我还在想你们会不会迷路了呢。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 1, fade_out = true, relevance_id = {102040501, 102040503, 102040504, 102040505, 102040508, 102040509, 102040510, 102040513, 102040514, 102040515, 102040523, 102040524, 102040525}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {8010207}},
	[102040502] = {talk_id = 102040502, group_id = 1020405, type = 2, next_id = 0, talk_content = "唔，你刚刚好像在聊什么重要的事情呐，我们不会妨碍到你了吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"你竟然会在意这个吗？", 102040503}, {"（赞同司命的顾虑）", 102040504}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040503] = {talk_id = 102040503, group_id = 1020405, type = 3, next_id = 102040505, talk_content = "我可是知书达理的神鸟，别把我当野蛮人。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040504] = {talk_id = 102040504, group_id = 1020405, type = 3, next_id = 102040505, talk_content = "在你们到的时候刚好聊完，所以没什么妨碍不妨碍的。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040505] = {talk_id = 102040505, group_id = 1020405, type = 1, next_id = 102040506, talk_content = "倒是我没想到你小子竟然是个大人物呐，看着像是个官对吧！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040506] = {talk_id = 102040506, group_id = 1020405, type = 1, next_id = 102040507, talk_content = "只是个负责日常治安的小司长而已，算不上什么大人物。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040507] = {talk_id = 102040507, group_id = 1020405, type = 2, next_id = 0, talk_content = "对了，说到这里，义人们认为这座城市如何？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"挺不错的。", 102040508}, {"暂时没什么想法。", 102040509}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040508] = {talk_id = 102040508, group_id = 1020405, type = 3, next_id = 102040510, talk_content = "那是再好不过了，街上还有很多商铺，你们之后大可到处逛逛。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040509] = {talk_id = 102040509, group_id = 1020405, type = 3, next_id = 102040510, talk_content = "的确，一路上都是走马观花，谈不上什么感受呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040510] = {talk_id = 102040510, group_id = 1020405, type = 1, next_id = 102040511, talk_content = "……", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040511] = {talk_id = 102040511, group_id = 1020405, type = 1, next_id = 102040512, talk_content = "闻到了麻烦的气味。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040512] = {talk_id = 102040512, group_id = 1020405, type = 2, next_id = 0, talk_content = "我就开门见山吧，义人，我希望你们能再帮我一个忙。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"清剿噬脉生物？", 102040513}, {"我可能有别的事情要处理。", 102040514}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040513] = {talk_id = 102040513, group_id = 1020405, type = 3, next_id = 102040515, talk_content = "不愧是义人，明察秋毫啊。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040514] = {talk_id = 102040514, group_id = 1020405, type = 3, next_id = 102040515, talk_content = "这是自然，我没有让义人强行接受的意思，\n但只是听听应该可以吧？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040515] = {talk_id = 102040515, group_id = 1020405, type = 1, next_id = 102040516, talk_content = "就如义人进门前听见的那样，\n我们有准备组织清剿噬脉生物的行动。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040516] = {talk_id = 102040516, group_id = 1020405, type = 1, next_id = 102040517, talk_content = "而之所以会组织这个行动，是因为最近噬脉生物有向城里靠近的迹象。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040517] = {talk_id = 102040517, group_id = 1020405, type = 1, next_id = 102040518, talk_content = "很出奇吗，噬脉生物本来就是会往其他活物所在的地方聚集的吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040518] = {talk_id = 102040518, group_id = 1020405, type = 1, next_id = 102040519, talk_content = "但不同的点在于他们基本都大群行动，彷佛要攻下这个地区一样。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040519] = {talk_id = 102040519, group_id = 1020405, type = 1, next_id = 102040520, talk_content = "而实际上，我们在外部建设的据点已经基本沦陷了。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040520] = {talk_id = 102040520, group_id = 1020405, type = 1, next_id = 102040521, talk_content = "城里面倒是看不见这股紧张劲呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040521] = {talk_id = 102040521, group_id = 1020405, type = 1, next_id = 102040522, talk_content = "我们不希望市民过度恐慌，\n噬脉生物的袭击大家也都是习以为常了。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040522] = {talk_id = 102040522, group_id = 1020405, type = 2, next_id = 0, talk_content = "但假若再这样下去，\n噬脉生物们的下一个目标可能就是这座熙来城了。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"你们防不住吗？", 102040523}, {"那该怎么办？", 102040524}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040523] = {talk_id = 102040523, group_id = 1020405, type = 3, next_id = 102040525, talk_content = "防卫的力量我们当然是有，但真在城内发生那样的战斗会很麻烦。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040524] = {talk_id = 102040524, group_id = 1020405, type = 3, next_id = 102040525, talk_content = "在发生状况之前由我们主动出击，这是现在的普遍想法。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040525] = {talk_id = 102040525, group_id = 1020405, type = 1, next_id = 102040526, talk_content = "唔……所以呢，你是想让我们干什么？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040526] = {talk_id = 102040526, group_id = 1020405, type = 1, next_id = 102040527, talk_content = "我希望拥有出色作战能力的义人能作为我们的协助者，\n为我们夺回‘悬天’的据点。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040527] = {talk_id = 102040527, group_id = 1020405, type = 1, next_id = 102040528, talk_content = "等等，悬天……你刚刚是说了悬天这两个字吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040528] = {talk_id = 102040528, group_id = 1020405, type = 1, next_id = 102040529, talk_content = "是，是的，难不成义人与那个大企业有什么关系吗？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040529] = {talk_id = 102040529, group_id = 1020405, type = 1, next_id = 102040530, talk_content = "……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040530] = {talk_id = 102040530, group_id = 1020405, type = 1, next_id = 102040531, talk_content = "司命，这是怎么回事，他说那个是企业？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040531] = {talk_id = 102040531, group_id = 1020405, type = 1, next_id = 102040532, talk_content = "这种事等下再说。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040532] = {talk_id = 102040532, group_id = 1020405, type = 1, next_id = 102040533, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040533] = {talk_id = 102040533, group_id = 1020405, type = 1, next_id = 102040534, talk_content = "……谈话似乎有些长了。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040534] = {talk_id = 102040534, group_id = 1020405, type = 1, next_id = 102040535, talk_content = "两位义人，据点的位置我会为你们标记起来，\n假若有意的话，请务必协助我们。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102040535] = {talk_id = 102040535, group_id = 1020405, type = 1, next_id = 0, talk_content = "另外先前说好的酬谢我也准备好了，请在离开时一并带走吧。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050101] = {talk_id = 102050101, group_id = 1020501, type = 4, next_id = 102050102, talk_content = "司命，你能说明一下刚刚那个吧，\n关于悬天的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102050101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050102] = {talk_id = 102050102, group_id = 1020501, type = 4, next_id = 0, talk_content = "找个人少些的地方吧，我看城外就不错。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050201] = {talk_id = 102050201, group_id = 1020502, type = 1, next_id = 102050202, talk_content = "咳咳。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102050201, 102050203, 102050204, 102050205, 102050210, 102050215, 102050216, 102050217}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050202] = {talk_id = 102050202, group_id = 1020502, type = 2, next_id = 0, talk_content = "是的，追缉你的悬天组织是当今世界首屈一指的大企业。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"更详细的呢？", 102050203}, {"他们不应该是什么邪恶组织才对吗？", 102050204}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050203] = {talk_id = 102050203, group_id = 1020502, type = 3, next_id = 102050205, talk_content = "喜欢刨根问底的小朋友真让人烦心呐。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050204] = {talk_id = 102050204, group_id = 1020502, type = 3, next_id = 102050205, talk_content = "邪恶组织和企业并不是互斥的东西呐。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050205] = {talk_id = 102050205, group_id = 1020502, type = 1, next_id = 102050206, talk_content = "悬天是一个大型能源企业，大概是在50年前吧，他们表示自己能采集气脉能量，并且将其转化为人们可用的能源。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050206] = {talk_id = 102050206, group_id = 1020502, type = 1, next_id = 102050207, talk_content = "自此世界各处就遍布悬天的能源设施，分属机构，甚至出现了贴着他们铭牌的武装队伍。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050207] = {talk_id = 102050207, group_id = 1020502, type = 1, next_id = 102050208, talk_content = "现在想起我也因为那个受了不少罪呐。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050208] = {talk_id = 102050208, group_id = 1020502, type = 1, next_id = 102050209, talk_content = "别岔开话题。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050209] = {talk_id = 102050209, group_id = 1020502, type = 2, next_id = 0, talk_content = "我不是人类，所以更多的详细不太清楚，但最终的结果就是他们在大地上升起了九个说是能更好提取与分配能量的太阳。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"那不是你想让我消灭的东西吗？", 102050210}, {"事情变麻烦起来了。", 102050210}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050210] = {talk_id = 102050210, group_id = 1020502, type = 3, next_id = 102050211, talk_content = "总之，世界在那九个太阳升起之后就发生了诡异的变化，在人类所感知不到的地方各种东西开始了蠢动。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050211] = {talk_id = 102050211, group_id = 1020502, type = 3, next_id = 102050212, talk_content = "比如呢？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050212] = {talk_id = 102050212, group_id = 1020502, type = 3, next_id = 102050213, talk_content = "就比如噬脉生物们开始大批量向人类所在地攻击这件事。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050213] = {talk_id = 102050213, group_id = 1020502, type = 3, next_id = 102050214, talk_content = "还有，路上不是能看见枯萎的，被破坏的气脉吗，那些就是太阳过度割取能量的结果。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050214] = {talk_id = 102050214, group_id = 1020502, type = 2, next_id = 0, talk_content = "要是继续放任那九个太阳世界就会迎来终结，\n毕竟作为生命之源的气脉都要没有了呐。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"你没有和其他人说这件事吗？", 102050215}, {"悬天是知道这个后果的吗？", 102050216}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050215] = {talk_id = 102050215, group_id = 1020502, type = 3, next_id = 102050217, talk_content = "说也没用吧，就如现在，你对我的话也半信半疑不是吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050216] = {talk_id = 102050216, group_id = 1020502, type = 3, next_id = 102050217, talk_content = "这我就不晓得了，但我估计是知道的吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050217] = {talk_id = 102050217, group_id = 1020502, type = 1, next_id = 102050218, talk_content = "……我们去温罗说的悬天据点看看。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050218] = {talk_id = 102050218, group_id = 1020502, type = 1, next_id = 102050219, talk_content = "怎么，有心拯救世界了吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050219] = {talk_id = 102050219, group_id = 1020502, type = 1, next_id = 102050220, talk_content = "我的记忆，破坏世界的太阳……假若一切的源头都是那个悬天的话，那走一趟也没坏。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
