	[102050223] = {talk_id = 102050223, group_id = 1020502, type = 1, next_id = 102050224, talk_content = "哦，这个是空洞，名字我也不知道为啥叫这个，但既然碰见了的话就进去看看如何？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
