	[102050301] = {talk_id = 102050301, group_id = 1020503, type = 1, next_id = 102050302, talk_content = "这个地方是……司命，这是哪里？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102050301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050302] = {talk_id = 102050302, group_id = 1020503, type = 1, next_id = 102050303, talk_content = "你就当成是个异空间而已，顺带一提就算是相同的‘空洞’，不同的人进入也会看见不同的景色哦。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050303] = {talk_id = 102050303, group_id = 1020503, type = 1, next_id = 102050304, talk_content = "也就是说这是只有我进入才能看见的风景吗……或者和我的记忆。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050304] = {talk_id = 102050304, group_id = 1020503, type = 1, next_id = 0, talk_content = "你可以先把思考环节放后一些，有怪物来了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050401] = {talk_id = 102050401, group_id = 1020504, type = 4, next_id = 102050402, talk_content = "异空间里面也有噬脉生物吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102050401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050402] = {talk_id = 102050402, group_id = 1020504, type = 4, next_id = 102050403, talk_content = "这大概是这个空洞的规则吧，青乌，注意规则，不然一辈子都没法打败这东西哦。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
