	[102050502] = {talk_id = 102050502, group_id = 1020505, type = 4, next_id = 102050503, talk_content = "嗯，感觉这地方变回‘空洞’了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050503] = {talk_id = 102050503, group_id = 1020505, type = 4, next_id = 102050504, talk_content = "青乌，虽然这地方很麻烦，但一般来说都能得到些好东西，之后路过空洞也进来看看吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
