	[102050601] = {talk_id = 102050601, group_id = 1020506, type = 1, next_id = 102050602, talk_content = "你好你好，你们刚刚从空洞回来是吧？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102050601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050602] = {talk_id = 102050602, group_id = 1020506, type = 1, next_id = 102050603, talk_content = "你是……还有你是怎么在我耳边说话的？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050603] = {talk_id = 102050603, group_id = 1020506, type = 1, next_id = 102050604, talk_content = "只是有点小手段而已，对了，你叫我阿一就好。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050604] = {talk_id = 102050604, group_id = 1020506, type = 1, next_id = 102050605, talk_content = "这名字和阿猫阿狗听上去差不多呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050605] = {talk_id = 102050605, group_id = 1020506, type = 1, next_id = 102050606, talk_content = "哈哈哈，我这名字可是由尊贵的……咳咳，这个先不提了。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050606] = {talk_id = 102050606, group_id = 1020506, type = 1, next_id = 0, talk_content = "总之你们先回城里一趟吧，我手上有能帮到你们的东西噢。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050701] = {talk_id = 102050701, group_id = 1020507, type = 1, next_id = 102050702, talk_content = "两位好，我就是阿一，真的十分感谢两位能移驾来找我呢。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102050701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102050702] = {talk_id = 102050702, group_id = 1020507, type = 1, next_id = 102050703, talk_content = "因为你说了能帮到我们，所以你是知道我们的事情吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050703] = {talk_id = 102050703, group_id = 1020507, type = 1, next_id = 102050704, talk_content = "些许，不过这些其实都不是重点，重要的是你们是能从空洞中平安回归的人物。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050704] = {talk_id = 102050704, group_id = 1020507, type = 1, next_id = 102050705, talk_content = "虽然我知道里面很危险，但能回来很奇怪吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050705] = {talk_id = 102050705, group_id = 1020507, type = 1, next_id = 102050706, talk_content = "我刚刚也说了，重要的是‘平安’。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050706] = {talk_id = 102050706, group_id = 1020507, type = 1, next_id = 102050707, talk_content = "闲话就不说太多了，我阿一是一位空洞研究学家，现在正寻找一些能帮忙调查空洞的人。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102050707] = {talk_id = 102050707, group_id = 1020507, type = 1, next_id = 102050708, talk_content = "原来是要我们帮忙打工，那报酬到底是什么？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
