	[102060101] = {talk_id = 102060101, group_id = 1020601, type = 4, next_id = 102060102, talk_content = "好，下一步就往据点那边去吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102060101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060102] = {talk_id = 102060102, group_id = 1020601, type = 4, next_id = 102060103, talk_content = "假若悬天真如你口中那样，\n那我现在是不是不太安全？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060103] = {talk_id = 102060103, group_id = 1020601, type = 4, next_id = 102060104, talk_content = "关于青乌的事应该也是机密中的机密，那个离歌看着也不像是普通人吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060104] = {talk_id = 102060104, group_id = 1020601, type = 4, next_id = 102060105, talk_content = "……就是他们不打算告知\n下层知道关于我的一切吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060105] = {talk_id = 102060105, group_id = 1020601, type = 4, next_id = 0, talk_content = "应该是那样。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060201] = {talk_id = 102060201, group_id = 1020602, type = 1, next_id = 102060202, talk_content = "地图上指的就是这里没错吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102060201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060202] = {talk_id = 102060202, group_id = 1020602, type = 1, next_id = 102060203, talk_content = "嗯，这里就是悬天的据点。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060203] = {talk_id = 102060203, group_id = 1020602, type = 1, next_id = 102060204, talk_content = "可是看不清楚里面到底什么状况。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060204] = {talk_id = 102060204, group_id = 1020602, type = 1, next_id = 102060205, talk_content = "要不靠近看看？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060205] = {talk_id = 102060205, group_id = 1020602, type = 1, next_id = 0, talk_content = "等等，两位就是青乌和司命对吧？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060301] = {talk_id = 102060301, group_id = 1020603, type = 1, next_id = 102060302, talk_content = "你是？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102060301, 102060305, 102060306, 102060308}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060302] = {talk_id = 102060302, group_id = 1020603, type = 1, next_id = 102060303, talk_content = "我叫刻刻，是维安司的成员，没想到竟然是真人，\n司长和我提增援的时候我还以为只是开个玩笑呢。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060303] = {talk_id = 102060303, group_id = 1020603, type = 1, next_id = 102060304, talk_content = "温罗那家伙，说是让我们考虑，但实际早就猜到我们会帮忙了呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060304] = {talk_id = 102060304, group_id = 1020603, type = 2, next_id = 0, talk_content = "怎么听着感觉怪怪的，难不成你们只是来看看的？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"我们是来帮忙的。", 102060305}, {"是的，我只是来看看。", 102060306}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060305] = {talk_id = 102060305, group_id = 1020603, type = 3, next_id = 102060308, talk_content = "那太好了，悬天的据点规格要大上不少，只靠我一个人可抢不回来呢。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060306] = {talk_id = 102060306, group_id = 1020603, type = 3, next_id = 102060307, talk_content = "什，什么……果然增援什么的只是个骗局，我又一次被骗了吗！", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060307] = {talk_id = 102060307, group_id = 1020603, type = 3, next_id = 102060308, talk_content = "那只是青乌的玩笑而已，我们是来帮忙的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060308] = {talk_id = 102060308, group_id = 1020603, type = 1, next_id = 102060309, talk_content = "所以里面的状况怎么样，你有侦察过吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060309] = {talk_id = 102060309, group_id = 1020603, type = 1, next_id = 102060310, talk_content = "都看过了，普通的怪物若干，理论上不成问题。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060310] = {talk_id = 102060310, group_id = 1020603, type = 1, next_id = 102060311, talk_content = "但精英级的有两三只，可能还有些藏在暗处没发现。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060311] = {talk_id = 102060311, group_id = 1020603, type = 1, next_id = 102060312, talk_content = "只是这样的话没什么问题吧，听着挺好对付的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060312] = {talk_id = 102060312, group_id = 1020603, type = 1, next_id = 102060313, talk_content = "但难点其实是在据点上面，悬天的据点中装了不少警报器。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060313] = {talk_id = 102060313, group_id = 1020603, type = 1, next_id = 102060314, talk_content = "虽然那里面现在被怪物们侵占了，但机械还有在运作，一旦被发现的话那个就会发出巨响，那个声音可能会引来其他怪物也说不定。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060314] = {talk_id = 102060314, group_id = 1020603, type = 1, next_id = 102060315, talk_content = "唔，那噬脉生物就不会引发警报吗，\n比起我们那些家伙不才是要警报的东西？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060315] = {talk_id = 102060315, group_id = 1020603, type = 1, next_id = 102060316, talk_content = "那个警报似乎平时并不会启用，噬脉生物在占领这个地方之后扰乱了气脉，导致那个警报器被误启动了。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060316] = {talk_id = 102060316, group_id = 1020603, type = 1, next_id = 102060317, talk_content = "原本就在里面的不算威胁，是这个说法噢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060317] = {talk_id = 102060317, group_id = 1020603, type = 1, next_id = 102060318, talk_content = "嗯。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060318] = {talk_id = 102060318, group_id = 1020603, type = 1, next_id = 102060319, talk_content = "那是挺麻烦的……你有什么解决办法吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060319] = {talk_id = 102060319, group_id = 1020603, type = 1, next_id = 0, talk_content = "哼哼，那当然有！", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060401] = {talk_id = 102060401, group_id = 1020604, type = 4, next_id = 102060402, talk_content = "据点内的噬脉生物似乎都解决干净了。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102060401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060402] = {talk_id = 102060402, group_id = 1020604, type = 4, next_id = 102060403, talk_content = "那接下来就该干我们的事了，青乌，找个可以用的终端吧，或者能找到些有用的档案。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060403] = {talk_id = 102060403, group_id = 1020604, type = 4, next_id = 0, talk_content = "你这鸟到底从那里学来这些的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060501] = {talk_id = 102060501, group_id = 1020605, type = 2, next_id = 0, talk_content = "怎么样，有没有什么值得注意的点。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"追猎者。", 102060502}, {"没有。", 102060503}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102060501, 102060502, 102060503, 102060504, 102060508, 102060509, 102060512}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060502] = {talk_id = 102060502, group_id = 1020605, type = 3, next_id = 102060504, talk_content = "嗯，你也瞧见那个单词了吧，感觉不是什么好东西呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060503] = {talk_id = 102060503, group_id = 1020605, type = 3, next_id = 102060504, talk_content = "怎么可能没有，不是有个档案上面写着奇怪的名字的吗，就追猎者那个！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060504] = {talk_id = 102060504, group_id = 1020605, type = 1, next_id = 102060505, talk_content = "虽然档案写得不多，但里面有提到让各个据点给追猎者放行的这件事。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060505] = {talk_id = 102060505, group_id = 1020605, type = 1, next_id = 102060506, talk_content = "还有谨慎留意最近突然出现的人物，并且上报到系统。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060506] = {talk_id = 102060506, group_id = 1020605, type = 1, next_id = 102060507, talk_content = "很明显，那个追猎者就是瞄着我们派来的刺客，就像离歌那样呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060507] = {talk_id = 102060507, group_id = 1020605, type = 2, next_id = 0, talk_content = "呃，你们是和悬天有什么过节吗，该不会是反抗份子吧？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"反抗份子指的是？", 102060508}, {"我不记得。", 102060509}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060508] = {talk_id = 102060508, group_id = 1020605, type = 3, next_id = 102060512, talk_content = "不，当我没说过吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060509] = {talk_id = 102060509, group_id = 1020605, type = 3, next_id = 102060510, talk_content = "也是，司长那边怎么也不可能让那些人帮忙。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060510] = {talk_id = 102060510, group_id = 1020605, type = 3, next_id = 102060511, talk_content = "不记得？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060511] = {talk_id = 102060511, group_id = 1020605, type = 3, next_id = 102060512, talk_content = "这是我们自己的事情，你还是别问那么多比较好哦。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
