	[102060514] = {talk_id = 102060514, group_id = 1020605, type = 1, next_id = 102060515, talk_content = "主动出击，刚好档案上面有写追猎者暂留的地点。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060515] = {talk_id = 102060515, group_id = 1020605, type = 1, next_id = 102060516, talk_content = "呵？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060516] = {talk_id = 102060516, group_id = 1020605, type = 1, next_id = 102060517, talk_content = "我们的存在并没有被明确指出，就代表追捕我们的行动\n应该只会是离歌那样的少数精英。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060517] = {talk_id = 102060517, group_id = 1020605, type = 1, next_id = 102060518, talk_content = "那就代表我们每次都只需要应付一个，再说……\n我还没有得到关于自己的情报。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060518] = {talk_id = 102060518, group_id = 1020605, type = 1, next_id = 102060519, talk_content = "既然悬天因为什么而追捕我，那么我只要慢慢解决他们，\n再把那个什么找出来就是。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060519] = {talk_id = 102060519, group_id = 1020605, type = 1, next_id = 102060520, talk_content = "这种做法我并不讨厌，准了！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060520] = {talk_id = 102060520, group_id = 1020605, type = 1, next_id = 102060521, talk_content = "既然如此……接下来也能让我一起吗？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060521] = {talk_id = 102060521, group_id = 1020605, type = 1, next_id = 102060522, talk_content = "为啥，你的工作应该只是夺回这个据点而已吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102060522] = {talk_id = 102060522, group_id = 1020605, type = 1, next_id = 102060523, talk_content = "刚刚找到的档案里面也有让我感到在意的事情，拜托了，\n假若要面对强敌的话我应该能帮上什么才是。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
