	[102080102] = {talk_id = 102080102, group_id = 1020801, type = 4, next_id = 102080103, talk_content = "虽然我也知道悬天是不会放弃追击，但没想到人都已经准备好了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080103] = {talk_id = 102080103, group_id = 1020801, type = 4, next_id = 102080104, talk_content = "说起来你刚刚是记起了些什么。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080104] = {talk_id = 102080104, group_id = 1020801, type = 4, next_id = 102080105, talk_content = "……我需要整理一下再说出来。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080105] = {talk_id = 102080105, group_id = 1020801, type = 4, next_id = 102080106, talk_content = "呵，还会跟我故弄玄虚了？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080106] = {talk_id = 102080106, group_id = 1020801, type = 4, next_id = 102080107, talk_content = "呃，所以记起这个是什么意思？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080107] = {talk_id = 102080107, group_id = 1020801, type = 4, next_id = 0, talk_content = "只是这家伙有点健忘而已。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080201] = {talk_id = 102080201, group_id = 1020802, type = 4, next_id = 0, talk_content = "司长应该还在办公室内，我们直接进去吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102080201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080301] = {talk_id = 102080301, group_id = 1020803, type = 1, next_id = 102080302, talk_content = "这不是刻刻和义人吗，我收到斥候的报告了，你们收回据点了对吧？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102080301, 102080319, 102080336, 102080337, 102080338}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080302] = {talk_id = 102080302, group_id = 1020803, type = 1, next_id = 102080303, talk_content = "是的，多亏有青乌的协助才能如此顺利，这下据点能重新投入生产了，但……", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080303] = {talk_id = 102080303, group_id = 1020803, type = 1, next_id = 102080304, talk_content = "但？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080304] = {talk_id = 102080304, group_id = 1020803, type = 1, next_id = 102080305, talk_content = "司长，除了收复据点以外，我们还遇见了一只强大的噬脉生物，而那只噬脉生物似乎与悬天有什么关系。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080305] = {talk_id = 102080305, group_id = 1020803, type = 1, next_id = 102080306, talk_content = "噬脉生物与悬天有关联……你为什么会有这个结论？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080306] = {talk_id = 102080306, group_id = 1020803, type = 1, next_id = 102080307, talk_content = "因为我从被打败的噬脉生物身上得到了太阳的碎片。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080307] = {talk_id = 102080307, group_id = 1020803, type = 1, next_id = 102080308, talk_content = "太阳的碎片，就是之前也在局里展出过的东西吧……", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080308] = {talk_id = 102080308, group_id = 1020803, type = 1, next_id = 102080309, talk_content = "是的，而且在战斗的途中那个噬脉生物似乎还表达出了对太阳的热枕。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080309] = {talk_id = 102080309, group_id = 1020803, type = 1, next_id = 102080310, talk_content = "恍若那个太阳就是他们的神明一样，之前的噬脉生物们也会这样吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080310] = {talk_id = 102080310, group_id = 1020803, type = 1, next_id = 102080311, talk_content = "不，我可没遇过这样的状况，说到底，太阳的碎片一直都是悬天用来作展出的宣传品。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080311] = {talk_id = 102080311, group_id = 1020803, type = 1, next_id = 102080312, talk_content = "一般是不应该落到噬脉生物手上才对……", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080312] = {talk_id = 102080312, group_id = 1020803, type = 1, next_id = 102080313, talk_content = "所以说他们是一伙的话就说得通了吧，悬天因为什么原因把碎片交给了噬脉生物。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080313] = {talk_id = 102080313, group_id = 1020803, type = 1, next_id = 102080314, talk_content = "……不，请义人们停止这种猜测，我们不能往那个方向去思考。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080314] = {talk_id = 102080314, group_id = 1020803, type = 1, next_id = 102080315, talk_content = "司长，你是不相信我们吗，虽然这个只是间接证据，但现在区域内的噬脉生物暴动已经……", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080315] = {talk_id = 102080315, group_id = 1020803, type = 1, next_id = 102080316, talk_content = "悬天是当今的能源龙头，他们就如同社会的第二位管理者。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080316] = {talk_id = 102080316, group_id = 1020803, type = 1, next_id = 102080317, talk_content = "现在就先当作什么都没发生吧，刻刻。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080317] = {talk_id = 102080317, group_id = 1020803, type = 1, next_id = 102080318, talk_content = "……", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080318] = {talk_id = 102080318, group_id = 1020803, type = 2, next_id = 0, talk_content = "噢，不愧是当了官的，你这家伙还挺机灵嘛？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"悬天的权力有这么大吗？", 102080319}, {"这样真的好吗？", 102080319}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080319] = {talk_id = 102080319, group_id = 1020803, type = 3, next_id = 102080320, talk_content = "就如我说的，悬天掌控着城市中的能源命脉，我并不是不相信你们。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080320] = {talk_id = 102080320, group_id = 1020803, type = 3, next_id = 102080321, talk_content = "只是仅凭一块无法证明来历的太阳的碎片，恐怕不足以撼动悬天这颗大树。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080321] = {talk_id = 102080321, group_id = 1020803, type = 3, next_id = 102080322, talk_content = "毕竟那个神荼在被打败以后就自行消灭变成粒子了呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080322] = {talk_id = 102080322, group_id = 1020803, type = 3, next_id = 102080323, talk_content = "总之这件事先放一边，义人，十分感谢你能协助我们收回据点。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080323] = {talk_id = 102080323, group_id = 1020803, type = 3, next_id = 102080324, talk_content = "作为报酬我约好了城里的房间和饭店，你之后……", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080324] = {talk_id = 102080324, group_id = 1020803, type = 3, next_id = 102080325, talk_content = "相比起这些我想要看看之前展出过的太阳的碎片。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080325] = {talk_id = 102080325, group_id = 1020803, type = 3, next_id = 102080326, talk_content = "呃，义人为何想要看那个，再说你们手上现在不是有一块了吗？", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080326] = {talk_id = 102080326, group_id = 1020803, type = 3, next_id = 102080327, talk_content = "我有些私事需要用到，虽然是刚刚才知道，所以说能让我看看吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080327] = {talk_id = 102080327, group_id = 1020803, type = 3, next_id = 102080328, talk_content = "很可惜，假若是一周前的话我肯定会帮义人这个忙，但现在碎片已经不在熙来城里面了。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080328] = {talk_id = 102080328, group_id = 1020803, type = 3, next_id = 102080329, talk_content = "该不会说被某某人带走了吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080329] = {talk_id = 102080329, group_id = 1020803, type = 3, next_id = 102080330, talk_content = "一周前，该不会是创生主义之前的行动……", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080330] = {talk_id = 102080330, group_id = 1020803, type = 3, next_id = 102080331, talk_content = "嗯，悬天因此提前结束了展出，把碎片带回到他们管理的仓库了。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080331] = {talk_id = 102080331, group_id = 1020803, type = 3, next_id = 102080332, talk_content = "那仓库在哪里？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080332] = {talk_id = 102080332, group_id = 1020803, type = 3, next_id = 102080333, talk_content = "就在城的西北方，在某个地下隧道之中，不知道哪里有没有被噬脉生物占领呢……", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080333] = {talk_id = 102080333, group_id = 1020803, type = 3, next_id = 102080334, talk_content = "无论有没有被占领，对我来说下一步也只能往哪里去了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080334] = {talk_id = 102080334, group_id = 1020803, type = 3, next_id = 102080335, talk_content = "虽然和拯救世界没什么关系就是了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080335] = {talk_id = 102080335, group_id = 1020803, type = 2, next_id = 0, talk_content = "等等，你们要走了吗？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"嗯，我有想要确认的事。", 102080336}, {"这次你也要跟着来吗？", 102080337}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080336] = {talk_id = 102080336, group_id = 1020803, type = 3, next_id = 102080338, talk_content = "是这样呐……我还以为能再和你们聊聊呢，比如悬天的事。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080337] = {talk_id = 102080337, group_id = 1020803, type = 3, next_id = 102080338, talk_content = "对不起，我还有维安警的任务，不能擅离职守。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080338] = {talk_id = 102080338, group_id = 1020803, type = 1, next_id = 102080339, talk_content = "既然义人如此匆忙的话那我不碍着义人，我让人准备一些报酬，请你有闲的话就去一楼取吧。", talk_name = "温罗", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080339] = {talk_id = 102080339, group_id = 1020803, type = 1, next_id = 102080340, talk_content = "嗯，谢谢。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102080340] = {talk_id = 102080340, group_id = 1020803, type = 1, next_id = 0, talk_content = "那下次再见了，十分感谢你的协助，青乌。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090101] = {talk_id = 102090101, group_id = 1020901, type = 4, next_id = 102090102, talk_content = "轻轻松松就有下一步的线索了呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102090101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090102] = {talk_id = 102090102, group_id = 1020901, type = 4, next_id = 102090103, talk_content = "真正轻松是我立刻就能得到那个太阳的碎片。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090103] = {talk_id = 102090103, group_id = 1020901, type = 4, next_id = 102090104, talk_content = "总之先去一楼把温罗说的报酬拿到手吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090104] = {talk_id = 102090104, group_id = 1020901, type = 4, next_id = 0, talk_content = "之后再去找你的记忆，再然后就是拯救世界。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090201] = {talk_id = 102090201, group_id = 1020902, type = 1, next_id = 102090202, talk_content = "你好，想必你就是司长提到过的青乌了，我是维安司的接待员。", talk_name = "接待员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102090201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090202] = {talk_id = 102090202, group_id = 1020902, type = 1, next_id = 102090203, talk_content = "接待呐，总之听说过我们的事情就好办了，温罗说你这边有给我们准备的报酬对吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090203] = {talk_id = 102090203, group_id = 1020902, type = 1, next_id = 102090204, talk_content = "是的，不过在交付之前能请你们听听这边的请求吗？", talk_name = "接待员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090204] = {talk_id = 102090204, group_id = 1020902, type = 1, next_id = 102090205, talk_content = "……该不会又想让我帮点什么吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090205] = {talk_id = 102090205, group_id = 1020902, type = 1, next_id = 102090206, talk_content = "只是想向你说明一下我们运营方针而已。", talk_name = "接待员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090206] = {talk_id = 102090206, group_id = 1020902, type = 1, next_id = 102090207, talk_content = "就如你所知的那样，世上大部分人都不是脉者，而世界上却有很多问题需要脉者才能解决。", talk_name = "接待员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090207] = {talk_id = 102090207, group_id = 1020902, type = 1, next_id = 102090208, talk_content = "好，我知道了，你是想让我们帮忙解决那些奇怪的问题是吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090208] = {talk_id = 102090208, group_id = 1020902, type = 1, next_id = 102090209, talk_content = "当然是有偿的委托，假若两位之后有空或者需要赚外快的话，请务必到这里来看看。", talk_name = "接待员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090209] = {talk_id = 102090209, group_id = 1020902, type = 1, next_id = 102090210, talk_content = "唔，听着是不错，青乌，之后有空就来这里接几个任务吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090210] = {talk_id = 102090210, group_id = 1020902, type = 1, next_id = 102090211, talk_content = "你不是只对拯救世界有兴趣吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090211] = {talk_id = 102090211, group_id = 1020902, type = 1, next_id = 0, talk_content = "筹集拯救世界用的资金也是很重要的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090301] = {talk_id = 102090301, group_id = 1020903, type = 4, next_id = 102090302, talk_content = "记得温罗说的是城的西北方，在隧道里面的来着。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102090301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090302] = {talk_id = 102090302, group_id = 1020903, type = 4, next_id = 0, talk_content = "到处看看有没有能钻下去的地方吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102090401] = {talk_id = 102090401, group_id = 1020904, type = 4, next_id = 0, talk_content = "青乌，那个是隧道的入口没错吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102090401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100101] = {talk_id = 102100101, group_id = 1021001, type = 1, next_id = 102100102, talk_content = "这里大概就是温罗说的仓库了吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102100101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100102] = {talk_id = 102100102, group_id = 1021001, type = 1, next_id = 102100103, talk_content = "看标记应该没错，但门从里面被反锁了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100103] = {talk_id = 102100103, group_id = 1021001, type = 1, next_id = 102100104, talk_content = "这时候用佩从不就好了嘛。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100104] = {talk_id = 102100104, group_id = 1021001, type = 1, next_id = 102100105, talk_content = "就路上那些小木人，我记得他们就能干这事的来着。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100105] = {talk_id = 102100105, group_id = 1021001, type = 1, next_id = 102100106, talk_content = "你这一路上有没有搞到那个的佩从？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100106] = {talk_id = 102100106, group_id = 1021001, type = 1, next_id = 102100107, talk_content = "一时半会我也不记得了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100107] = {talk_id = 102100107, group_id = 1021001, type = 1, next_id = 0, talk_content = "那你先找找看吧，没有的话我们到附近搞一个便是，毕竟那些小木人跟蚂蚁一样满地都是捏。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100201] = {talk_id = 102100201, group_id = 1021002, type = 4, next_id = 102100202, talk_content = "回头一想，我似乎是没有那个的佩从。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102100201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100202] = {talk_id = 102100202, group_id = 1021002, type = 4, next_id = 0, talk_content = "那我们在路边随便搞一只吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100301] = {talk_id = 102100301, group_id = 1021003, type = 1, next_id = 102100302, talk_content = "司命，是这个没错吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102100301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100302] = {talk_id = 102100302, group_id = 1021003, type = 1, next_id = 102100303, talk_content = "是它没错了，倒是你之后得在路上多多收集一些佩魔。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100303] = {talk_id = 102100303, group_id = 1021003, type = 1, next_id = 102100304, talk_content = "等到要用的时候才会去搞效率太低了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100304] = {talk_id = 102100304, group_id = 1021003, type = 1, next_id = 0, talk_content = "我会记下来的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100401] = {talk_id = 102100401, group_id = 1021004, type = 1, next_id = 102100402, talk_content = "轻轻松松。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102100401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100402] = {talk_id = 102100402, group_id = 1021004, type = 1, next_id = 102100403, talk_content = "实际操作的人是我吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100403] = {talk_id = 102100403, group_id = 1021004, type = 1, next_id = 102100404, talk_content = "可提醒你的人是我，倒是快点进去吧，要是宝物被人拿走就不好了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100404] = {talk_id = 102100404, group_id = 1021004, type = 1, next_id = 102100405, talk_content = "除了我以外大概也没人特地来这里找太阳的碎片了吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100405] = {talk_id = 102100405, group_id = 1021004, type = 1, next_id = 102100406, talk_content = "这可不好说，毕竟太阳的碎片这个名号听着就觉得挺容易被强盗盯上的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100406] = {talk_id = 102100406, group_id = 1021004, type = 1, next_id = 102100407, talk_content = "等等，擅自开锁还要拿走别人仓库的东西，我们现在干的和强盗差不……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100407] = {talk_id = 102100407, group_id = 1021004, type = 1, next_id = 102100408, talk_content = "闭嘴，虽然性质很像，但这里是悬天的仓库，换言之是恶党的仓库。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100408] = {talk_id = 102100408, group_id = 1021004, type = 1, next_id = 102100409, talk_content = "我只是来打击罪恶而已。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100409] = {talk_id = 102100409, group_id = 1021004, type = 1, next_id = 102100410, talk_content = "……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100410] = {talk_id = 102100410, group_id = 1021004, type = 1, next_id = 102100411, talk_content = "……别这样看着我，赶紧进去吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102100411] = {talk_id = 102100411, group_id = 1021004, type = 1, next_id = 0, talk_content = "嘿嘿，急了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110101] = {talk_id = 102110101, group_id = 1021101, type = 1, next_id = 102110102, talk_content = "喂，青乌，刚才走过的是悬天的士兵。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102110101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110102] = {talk_id = 102110102, group_id = 1021101, type = 1, next_id = 102110103, talk_content = "看不太清楚，你确定吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110103] = {talk_id = 102110103, group_id = 1021101, type = 1, next_id = 102110104, talk_content = "当然，我这双火眼金睛可不会看错。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110104] = {talk_id = 102110104, group_id = 1021101, type = 1, next_id = 102110105, talk_content = "是不是金睛另说，但我可没想到这里竟然还在正常运作，其他地方明明都是噬脉生物。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110105] = {talk_id = 102110105, group_id = 1021101, type = 1, next_id = 102110106, talk_content = "毕竟噬脉生物也不会特意打破锁钻到这种地方来。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110106] = {talk_id = 102110106, group_id = 1021101, type = 1, next_id = 102110107, talk_content = "也就是说接下来的对手是那些家伙。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110107] = {talk_id = 102110107, group_id = 1021101, type = 1, next_id = 102110108, talk_content = "应该也有不战斗的做法，总之一边应付悬天，一边找运到这里来的碎片吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110108] = {talk_id = 102110108, group_id = 1021101, type = 1, next_id = 0, talk_content = "就这么办。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110201] = {talk_id = 102110201, group_id = 1021102, type = 4, next_id = 102110202, talk_content = "青乌，这么大的仓库应该不只是用存放碎片的才对。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102110201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110202] = {talk_id = 102110202, group_id = 1021102, type = 4, next_id = 102110203, talk_content = "的确，你想到什么了吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110203] = {talk_id = 102110203, group_id = 1021102, type = 4, next_id = 102110204, talk_content = "我的意思是让你可以顺路拿点好东西。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
