	[102110305] = {talk_id = 102110305, group_id = 1021103, type = 1, next_id = 102110306, talk_content = "我说过了，她和我记忆中的人很像。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
