	[102110404] = {talk_id = 102110404, group_id = 1021104, type = 5, next_id = 102110405, talk_content = "你是……？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
