	[102110702] = {talk_id = 102110702, group_id = 1021107, type = 1, next_id = 102110703, talk_content = "我从头到尾都没说我们要打吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110703] = {talk_id = 102110703, group_id = 1021107, type = 1, next_id = 102110704, talk_content = "哎，是这样吗？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110704] = {talk_id = 102110704, group_id = 1021107, type = 1, next_id = 102110705, talk_content = "的确，是你这死猴子自说自话打过来了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110705] = {talk_id = 102110705, group_id = 1021107, type = 1, next_id = 102110706, talk_content = "哈哈……是这样吗，对了，我的名字叫义向。", talk_name = "义向", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110706] = {talk_id = 102110706, group_id = 1021107, type = 1, next_id = 102110707, talk_content = "1.不是说不随便说名字的吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110707] = {talk_id = 102110707, group_id = 1021107, type = 1, next_id = 102110708, talk_content = "只是不能和为恶者说名字而已，从刚才的‘交心’之中我已经明白你是个值得信赖的家伙了。", talk_name = "义向", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110708] = {talk_id = 102110708, group_id = 1021107, type = 1, next_id = 102110709, talk_content = "这家伙变脸变得还真快。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110709] = {talk_id = 102110709, group_id = 1021107, type = 1, next_id = 102110710, talk_content = "毕竟有好几次青乌都没有下死手，就算笨蛋如我大概也明白你们不是什么坏人了。", talk_name = "义向", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110710] = {talk_id = 102110710, group_id = 1021107, type = 1, next_id = 102110711, talk_content = "明白就好，倒是你为什么会在这里，你也不是悬天的人不是吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110711] = {talk_id = 102110711, group_id = 1021107, type = 1, next_id = 102110712, talk_content = "这个要不要出去再说，我们站在这里谈话也不安全。", talk_name = "义向", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110712] = {talk_id = 102110712, group_id = 1021107, type = 1, next_id = 102110713, talk_content = "当然，太阳的碎片我已经拿好了，走吧，这边有个通风口。", talk_name = "义向", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102110713] = {talk_id = 102110713, group_id = 1021107, type = 1, next_id = 0, talk_content = "就一定要钻通风口吗……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120101] = {talk_id = 102120101, group_id = 1021201, type = 1, next_id = 102120102, talk_content = "前面就是出口了吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120102] = {talk_id = 102120102, group_id = 1021201, type = 1, next_id = 102120103, talk_content = "呸呸，这通风口脏死了，我羽毛都被搞得黑漆漆的！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120103] = {talk_id = 102120103, group_id = 1021201, type = 1, next_id = 102120104, talk_content = "你不本来就是黑的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120104] = {talk_id = 102120104, group_id = 1021201, type = 1, next_id = 102120105, talk_content = "话说回来，那猴子呢？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120105] = {talk_id = 102120105, group_id = 1021201, type = 1, next_id = 102120106, talk_content = "人不见了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120106] = {talk_id = 102120106, group_id = 1021201, type = 1, next_id = 102120107, talk_content = "喂，地上有个纸条！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120107] = {talk_id = 102120107, group_id = 1021201, type = 1, next_id = 102120108, talk_content = "内容是……‘先行一步’？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120108] = {talk_id = 102120108, group_id = 1021201, type = 1, next_id = 102120109, talk_content = "‘碎片我就先拿走了，请你们之后直接来天柜城来找我。’", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120109] = {talk_id = 102120109, group_id = 1021201, type = 1, next_id = 102120110, talk_content = "‘从这一路向北就能看见天柜城，进城以后找找尾巴的标记。’", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120110] = {talk_id = 102120110, group_id = 1021201, type = 1, next_id = 102120111, talk_content = "‘我就在最后一个尾巴所指的地方等你们。’", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120111] = {talk_id = 102120111, group_id = 1021201, type = 1, next_id = 102120112, talk_content = "这是什么……解谜吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120112] = {talk_id = 102120112, group_id = 1021201, type = 1, next_id = 102120113, talk_content = "算不上，只是个留言而已，早知道刚刚应该直接把他打趴下的……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120113] = {talk_id = 102120113, group_id = 1021201, type = 1, next_id = 0, talk_content = "……你这家伙有时候还挺危险的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120201] = {talk_id = 102120201, group_id = 1021202, type = 4, next_id = 102120202, talk_content = "青乌，这附近有钟悬的气息，进城之前先去那边敲个钟吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120202] = {talk_id = 102120202, group_id = 1021202, type = 4, next_id = 102120203, talk_content = "为啥？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120203] = {talk_id = 102120203, group_id = 1021202, type = 4, next_id = 0, talk_content = "我有用就是了，反正敲响了钟悬以后能拓宽视野，对你规划道路也有帮助不是吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120301] = {talk_id = 102120301, group_id = 1021203, type = 1, next_id = 102120302, talk_content = "要说敲……这里也没有敲钟的东西。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120302] = {talk_id = 102120302, group_id = 1021203, type = 1, next_id = 102120303, talk_content = "奇了个怪了，钟杵是被谁拿走了吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120303] = {talk_id = 102120303, group_id = 1021203, type = 1, next_id = 102120304, talk_content = "那怎么办，直接用剑打上去能行吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120304] = {talk_id = 102120304, group_id = 1021203, type = 1, next_id = 102120305, talk_content = "钟和杵是一体的东西，用代替物就算能敲也没法发挥功效。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120305] = {talk_id = 102120305, group_id = 1021203, type = 1, next_id = 102120306, talk_content = "唔，看样子总觉得是有某人把杵给带走了，青乌，试着在周围找找看吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120306] = {talk_id = 102120306, group_id = 1021203, type = 1, next_id = 102120307, talk_content = "线索都没有是要怎么找？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120307] = {talk_id = 102120307, group_id = 1021203, type = 1, next_id = 0, talk_content = "足迹，气息，或者其他异常的东西，总会有办法的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120401] = {talk_id = 102120401, group_id = 1021204, type = 4, next_id = 102120402, talk_content = "要说像是痕迹的只有这个了吧，很明显有什么压过的痕迹。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120402] = {talk_id = 102120402, group_id = 1021204, type = 4, next_id = 102120403, talk_content = "看着是一路延申到树林里面呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120403] = {talk_id = 102120403, group_id = 1021204, type = 4, next_id = 0, talk_content = "去看看吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120501] = {talk_id = 102120501, group_id = 1021205, type = 4, next_id = 102120502, talk_content = "果然这个地方自然生态很丰富……一路走来都看见好几种感觉了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120501}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120502] = {talk_id = 102120502, group_id = 1021205, type = 4, next_id = 0, talk_content = "毕竟这里可是被人类称创生地的地方呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120601] = {talk_id = 102120601, group_id = 1021206, type = 1, next_id = 102120602, talk_content = "感觉我们越来越靠近太阳了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120602] = {talk_id = 102120602, group_id = 1021206, type = 1, next_id = 102120603, talk_content = "！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120603] = {talk_id = 102120603, group_id = 1021206, type = 1, next_id = 102120604, talk_content = "那些是普通的生物吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120604] = {talk_id = 102120604, group_id = 1021206, type = 1, next_id = 102120605, talk_content = "中间那只明显很不正常，有噬脉的气息在它身上。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120605] = {talk_id = 102120605, group_id = 1021206, type = 1, next_id = 102120606, talk_content = "所以是噬脉生物？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120606] = {talk_id = 102120606, group_id = 1021206, type = 1, next_id = 102120607, talk_content = "也不像是，奇怪，这到底是什么……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120607] = {talk_id = 102120607, group_id = 1021206, type = 1, next_id = 102120608, talk_content = "！！！", talk_name = "怪物", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120608] = {talk_id = 102120608, group_id = 1021206, type = 1, next_id = 0, talk_content = "也罢，反正都被盯上了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120701] = {talk_id = 102120701, group_id = 1021207, type = 4, next_id = 102120702, talk_content = "怎么有种一直都在和强敌战斗的感觉，这个世界到处都这么危险的吗！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120702] = {talk_id = 102120702, group_id = 1021207, type = 4, next_id = 102120703, talk_content = "或许这就是拯救世界的旅途了吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120703] = {talk_id = 102120703, group_id = 1021207, type = 4, next_id = 0, talk_content = "明明我都还没准备干那事！", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120801] = {talk_id = 102120801, group_id = 1021208, type = 4, next_id = 102120802, talk_content = "简直就和发狂了没两样。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120801}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120802] = {talk_id = 102120802, group_id = 1021208, type = 4, next_id = 0, talk_content = "它身体里面的噬脉之气到底是被谁弄进去的……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120901] = {talk_id = 102120901, group_id = 1021209, type = 4, next_id = 102120902, talk_content = "喂，青乌，杵在那边。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102120901}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120902] = {talk_id = 102120902, group_id = 1021209, type = 4, next_id = 102120903, talk_content = "看来犯人就是刚刚的生物了呢，难怪会有那种痕迹。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120903] = {talk_id = 102120903, group_id = 1021209, type = 4, next_id = 102120904, talk_content = "所以刚刚的到底怎么回事，那个是本来就那么危险的怪物吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102120904] = {talk_id = 102120904, group_id = 1021209, type = 4, next_id = 0, talk_content = "凶暴的家伙自然是有，但那个应该不是危险的品种才对。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121001] = {talk_id = 102121001, group_id = 1021210, type = 4, next_id = 0, talk_content = "可以，这样就能敲钟了，我们赶紧回去吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102121001}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121101] = {talk_id = 102121101, group_id = 1021211, type = 1, next_id = 102121102, talk_content = "很好，这样创生地就又有一片地方可以为我所用了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102121101, 102121104, 102121126, 102121127, 102121128}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121102] = {talk_id = 102121102, group_id = 1021211, type = 1, next_id = 102121103, talk_content = "什么叫为你所用。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121103] = {talk_id = 102121103, group_id = 1021211, type = 2, next_id = 0, talk_content = "就是字面上的意思，你敲响越多的钟悬，我能够运用的力量也就越多。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"为什么？", 102121104}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121104] = {talk_id = 102121104, group_id = 1021211, type = 3, next_id = 102121105, talk_content = "说来好像没和你说过呐，关于我真体之间的联系。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121105] = {talk_id = 102121105, group_id = 1021211, type = 3, next_id = 102121106, talk_content = "给我听好了，这个世界起源于一片混沌，随着天地开辟，气脉因此出现在了大地之上。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121106] = {talk_id = 102121106, group_id = 1021211, type = 3, next_id = 102121107, talk_content = "其后海洋，大陆分化演变，最终起源的生命于星球之上诞生。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121107] = {talk_id = 102121107, group_id = 1021211, type = 3, next_id = 102121108, talk_content = "是说细胞分子之类的？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121108] = {talk_id = 102121108, group_id = 1021211, type = 3, next_id = 102121109, talk_content = "这都什么东西，说到起源自然是起源十二兽了！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121109] = {talk_id = 102121109, group_id = 1021211, type = 3, next_id = 102121110, talk_content = "……没听说过。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121110] = {talk_id = 102121110, group_id = 1021211, type = 3, next_id = 102121111, talk_content = "顺带一提，创生地这里之所以会有这个名字是因为十二兽中的几只都诞生于此。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121111] = {talk_id = 102121111, group_id = 1021211, type = 3, next_id = 102121112, talk_content = "总之，十二兽在诞生之后就朝着不同的方向移动，他们的身体与气脉紧密联系", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121112] = {talk_id = 102121112, group_id = 1021211, type = 3, next_id = 102121113, talk_content = "走到哪里，生命的种子就会散播到哪里，最终，当这些散播种子的使者沉睡的时候，世界已遍布生命。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121113] = {talk_id = 102121113, group_id = 1021211, type = 3, next_id = 102121114, talk_content = "大概听懂了，就是创世神话一类的东西嘛，所以这跟你有什么关系？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121114] = {talk_id = 102121114, group_id = 1021211, type = 3, next_id = 102121115, talk_content = "你是真不懂还是装不懂，我都说到这份上了，哎。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121115] = {talk_id = 102121115, group_id = 1021211, type = 3, next_id = 102121116, talk_content = "所以说，我就是始源十二兽之一，名为酉的始源兽的……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121116] = {talk_id = 102121116, group_id = 1021211, type = 3, next_id = 102121117, talk_content = "的？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121117] = {talk_id = 102121117, group_id = 1021211, type = 3, next_id = 102121118, talk_content = "……残骸。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121118] = {talk_id = 102121118, group_id = 1021211, type = 3, next_id = 102121119, talk_content = "……这是怎么回事？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121119] = {talk_id = 102121119, group_id = 1021211, type = 3, next_id = 102121120, talk_content = "起源并不是永远，生命终有凋零之日，十二兽也是一样。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121120] = {talk_id = 102121120, group_id = 1021211, type = 3, next_id = 102121121, talk_content = "在酉顺应天命之后，我，司命就从那个残骸之中出生了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121121] = {talk_id = 102121121, group_id = 1021211, type = 3, next_id = 102121122, talk_content = "作为残骸的我就只记得一件事，青乌能够拯救这个世界。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121122] = {talk_id = 102121122, group_id = 1021211, type = 3, next_id = 102121123, talk_content = "所以之前你才会说你不知道。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121123] = {talk_id = 102121123, group_id = 1021211, type = 3, next_id = 102121124, talk_content = "嗯，不是失忆，只是因为我大概和酉已经不是一样的东西了，但是只要持续与气脉联系的话……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121124] = {talk_id = 102121124, group_id = 1021211, type = 3, next_id = 102121125, talk_content = "就能变回酉吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121125] = {talk_id = 102121125, group_id = 1021211, type = 2, next_id = 0, talk_content = "是的，只要变回真体，那么拯救世界之旅应该也会更轻松，甚至那几个太阳应该也可以轻松碾压过去才是。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"我没想到你竟然是个好人。", 102121126}, {"你应该早点和我说这些事。", 102121127}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121126] = {talk_id = 102121126, group_id = 1021211, type = 3, next_id = 102121128, talk_content = "什么叫没想到，你就这么想我是什么邪恶生物吗！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121127] = {talk_id = 102121127, group_id = 1021211, type = 3, next_id = 102121128, talk_content = "没机会捏，何况说出来也对情况没什么帮助吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121128] = {talk_id = 102121128, group_id = 1021211, type = 1, next_id = 102121129, talk_content = "唉，我只是说我两的关系或许能再好点而已，总之已经没有需要干的事情了吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121129] = {talk_id = 102121129, group_id = 1021211, type = 1, next_id = 102121130, talk_content = "嗯，钟也敲了，我们接下来就去城里面吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121130] = {talk_id = 102121130, group_id = 1021211, type = 1, next_id = 102121131, talk_content = "天柜城……太阳，我的记忆。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121131] = {talk_id = 102121131, group_id = 1021211, type = 1, next_id = 102121132, talk_content = "当然还有能预想到无数战斗。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121132] = {talk_id = 102121132, group_id = 1021211, type = 1, next_id = 102121133, talk_content = "城里面打起来没问题吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121133] = {talk_id = 102121133, group_id = 1021211, type = 1, next_id = 102121134, talk_content = "悬天的人打过来你也没办法吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121134] = {talk_id = 102121134, group_id = 1021211, type = 1, next_id = 102121135, talk_content = "拯救世界还挺辛苦的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121135] = {talk_id = 102121135, group_id = 1021211, type = 1, next_id = 102121136, talk_content = "唉，等等，你刚刚是不是说拯救世界这几个字了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102121136] = {talk_id = 102121136, group_id = 1021211, type = 1, next_id = 0, talk_content = "不，我没说过。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130101] = {talk_id = 102130101, group_id = 1021301, type = 4, next_id = 102130102, talk_content = "我没想到那上面真的是个城市，该不会这里的人全是这样生活的吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102130101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130102] = {talk_id = 102130102, group_id = 1021301, type = 4, next_id = 102130103, talk_content = "怎么可能，这是个特例而已。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130103] = {talk_id = 102130103, group_id = 1021301, type = 4, next_id = 102130104, talk_content = "世界的一切都是如此熟悉但又感到陌生……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130104] = {talk_id = 102130104, group_id = 1021301, type = 4, next_id = 102130105, talk_content = "？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130105] = {talk_id = 102130105, group_id = 1021301, type = 4, next_id = 102130106, talk_content = "无论如何，得先想办法回忆起一切。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130106] = {talk_id = 102130106, group_id = 1021301, type = 4, next_id = 0, talk_content = "可别忘了还有拯救世界！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130201] = {talk_id = 102130201, group_id = 1021302, type = 5, next_id = 102130202, talk_content = "司命，我应该没走错地方吧？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 1, fade_out = true, relevance_id = {102130201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102130202] = {talk_id = 102130202, group_id = 1021302, type = 5, next_id = 102130203, talk_content = "城里最大的建筑就是这个没跑了，倒是找人问问怎么到天上……", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130203] = {talk_id = 102130203, group_id = 1021302, type = 5, next_id = 102130204, talk_content = "把我这个脉者放着不用反而让一群普通人去办事你到底是怎么想的！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130204] = {talk_id = 102130204, group_id = 1021302, type = 5, next_id = 102130205, talk_content = "刚加入的新人是不能参与危险任务的，这我应该强调过很多次了吧？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130205] = {talk_id = 102130205, group_id = 1021302, type = 5, next_id = 102130206, talk_content = "调查队的名单里面不是有20几个人，加我一个有什么关系，我已经证明过自己实力了吧！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130206] = {talk_id = 102130206, group_id = 1021302, type = 5, next_id = 102130207, talk_content = "这不是实力问题，是组织纪律的问题，回到你的岗位上去！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130207] = {talk_id = 102130207, group_id = 1021302, type = 5, next_id = 102130208, talk_content = "跟你聊不下去了！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130208] = {talk_id = 102130208, group_id = 1021302, type = 5, next_id = 0, talk_content = "喂，等等！", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130301] = {talk_id = 102130301, group_id = 1021303, type = 4, next_id = 0, talk_content = "那家伙从衣服上看应该是个大官，去跟他问问上天的事情吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102130301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130401] = {talk_id = 102130401, group_id = 1021304, type = 1, next_id = 102130402, talk_content = "你好，方便问些问题吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102130401, 102130406, 102130407, 102130409, 102130410, 102130411}, addition_relevance_id = {102130501, 102130601}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102130402] = {talk_id = 102130402, group_id = 1021304, type = 1, next_id = 102130403, talk_content = "当然可以……啊，一人一鸟。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130403] = {talk_id = 102130403, group_id = 1021304, type = 1, next_id = 102130404, talk_content = "你知道我们？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130404] = {talk_id = 102130404, group_id = 1021304, type = 1, next_id = 102130405, talk_content = "刚刚温罗发来了一条信息，说是稍后会有一人一鸟的组合来拜访我。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130405] = {talk_id = 102130405, group_id = 1021304, type = 2, next_id = 0, talk_content = "先自我介绍一下吧，我的名字叫朱嫦，是这个维安司的司长，也就是总负责人。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"（自我介绍）", 102130406}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130406] = {talk_id = 102130406, group_id = 1021304, type = 3, next_id = 102130407, talk_content = "和温罗说的一样，感谢你们救下了帝江之地的居民，青乌以及司命。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130407] = {talk_id = 102130407, group_id = 1021304, type = 1, next_id = 102130408, talk_content = "要感谢的话就帮我们到天上去吧，那个温罗说是要来你这里办手续对吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130408] = {talk_id = 102130408, group_id = 1021304, type = 2, next_id = 0, talk_content = "手续的话在柜台附近就能办，但现在地上有些问题，相关的出入手续都被暂停了。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"有什么问题？", 102130409}, {"司长应该不会受限制吧？", 102130410}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130409] = {talk_id = 102130409, group_id = 1021304, type = 3, next_id = 102130411, talk_content = "是异常。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130410] = {talk_id = 102130410, group_id = 1021304, type = 3, next_id = 102130411, talk_content = "抱歉，我这个司长还没有这么大的权利，在‘异常’被解决之前就是我也不能到天柜城去。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130411] = {talk_id = 102130411, group_id = 1021304, type = 1, next_id = 102130412, talk_content = "异常是说什么？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130412] = {talk_id = 102130412, group_id = 1021304, type = 1, next_id = 102130413, talk_content = "简单来说就是土地上出现了反重力的区域。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130413] = {talk_id = 102130413, group_id = 1021304, type = 1, next_id = 102130414, talk_content = "怎么个反重力法？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130414] = {talk_id = 102130414, group_id = 1021304, type = 1, next_id = 102130415, talk_content = "就是东西都以倒立的形式浮起来了，对，就和天柜城一样。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130415] = {talk_id = 102130415, group_id = 1021304, type = 1, next_id = 102130416, talk_content = "就只是这样应该没什么问题吧，那个城市不也这么浮着吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130416] = {talk_id = 102130416, group_id = 1021304, type = 1, next_id = 102130417, talk_content = "但在异常出现之前只有天柜城是这样的状态，而且那些反重力区还是噬脉生物的聚集地。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130417] = {talk_id = 102130417, group_id = 1021304, type = 1, next_id = 102130418, talk_content = "就是说被怪物当作大本营了啊。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130418] = {talk_id = 102130418, group_id = 1021304, type = 1, next_id = 102130419, talk_content = "嗯，这个状况是百年未闻，所以在我们调查有所进展之前天柜城下令暂时封锁通行。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130419] = {talk_id = 102130419, group_id = 1021304, type = 1, next_id = 102130420, talk_content = "所以说真正管着帝江之地的是上面的家伙呐。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130420] = {talk_id = 102130420, group_id = 1021304, type = 1, next_id = 102130421, talk_content = "虽然有些岔开话题，但天柜到底是怎么回事，你们真的住在那里面吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130421] = {talk_id = 102130421, group_id = 1021304, type = 1, next_id = 0, talk_content = "这个算是外来人都会问的一个问题了，答案自然是是的，我们都住在那里面。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130501] = {talk_id = 102130501, group_id = 1021305, type = 1, next_id = 102130502, talk_content = "而这个帝江之地，原名为创生，天柜城，也并不是一开始就在空中的。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102130501}, addition_relevance_id = {102130601}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102130502] = {talk_id = 102130502, group_id = 1021305, type = 1, next_id = 102130503, talk_content = "自然，我们的祖先也从没有想过要在空中生活，日复一日和平的生活着。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130503] = {talk_id = 102130503, group_id = 1021305, type = 1, next_id = 102130504, talk_content = "但在数百年前的某一天，一场灾难改变了一切。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130504] = {talk_id = 102130504, group_id = 1021305, type = 1, next_id = 102130505, talk_content = "关于灾难的记载就只有只言片语，但可以知晓的是地上突然就不适合生存了。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130505] = {talk_id = 102130505, group_id = 1021305, type = 1, next_id = 102130506, talk_content = "在刹那间，城内外出现了无数因不明原因倒下的居民，圈养的家畜也无一幸免，唯一能在这场灾难中活下来的，就只有名为噬脉的可怖存在。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130506] = {talk_id = 102130506, group_id = 1021305, type = 1, next_id = 102130507, talk_content = "这些噬脉生物和灾难有何关系我们已不得而知，但无疑它们借着这场灾难大举向人类发起攻击，并将我们的祖先逼入了绝路。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130507] = {talk_id = 102130507, group_id = 1021305, type = 1, next_id = 102130508, talk_content = "在这个关头，远方的世界之宗主，王土送来了制世太阳——帝江。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130508] = {talk_id = 102130508, group_id = 1021305, type = 1, next_id = 102130509, talk_content = "以帝江之力，天柜城和周遭的一部份区域以倒立的形式被移到了天上，居民也因此脱离危难，保存了性命。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130509] = {talk_id = 102130509, group_id = 1021305, type = 1, next_id = 102130510, talk_content = "之后，帝江用其光芒持续照耀大地，最终就连地上的灾难也完全驱散，让天柜城的人们能重新回到大地之上。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130510] = {talk_id = 102130510, group_id = 1021305, type = 1, next_id = 102130511, talk_content = "于是，保持着尊敬和感激，人们将这片土地冠上了太阳的尊名。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130511] = {talk_id = 102130511, group_id = 1021305, type = 1, next_id = 102130512, talk_content = "而关于这段历史，后人有诗曰……", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130512] = {talk_id = 102130512, group_id = 1021305, type = 1, next_id = 0, talk_content = "日落帝江土，天柜倒空中。噬脉灾肆虐，帝光护生灵。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130601] = {talk_id = 102130601, group_id = 1021306, type = 1, next_id = 102130602, talk_content = "以上，就是关于这片土地和天柜城的历史，每当外人问起我们就会搬出这个，算是标准答案了。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102130601, 102130611, 102130612, 102130613, 102130616, 102130619}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102130602] = {talk_id = 102130602, group_id = 1021306, type = 1, next_id = 102130603, talk_content = "差点就睡着了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130603] = {talk_id = 102130603, group_id = 1021306, type = 1, next_id = 102130604, talk_content = "呃，果然是有点长了吗？", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130604] = {talk_id = 102130604, group_id = 1021306, type = 1, next_id = 102130605, talk_content = "司命，我有些在意的地方。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130605] = {talk_id = 102130605, group_id = 1021306, type = 1, next_id = 102130606, talk_content = "我知道，你要说太阳的事情对吧，这个等我们把进城的手续搞妥再谈如何？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130606] = {talk_id = 102130606, group_id = 1021306, type = 1, next_id = 102130607, talk_content = "就如我之前所说的，手续一时半会恐怕办不下来，但在道路重新开通以后我能够帮两位首先安排。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130607] = {talk_id = 102130607, group_id = 1021306, type = 1, next_id = 102130608, talk_content = "作为交换，我想拜托两位一件小事。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130608] = {talk_id = 102130608, group_id = 1021306, type = 1, next_id = 102130609, talk_content = "啥？太累得我可不干噢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130609] = {talk_id = 102130609, group_id = 1021306, type = 1, next_id = 102130610, talk_content = "帮我追回刻刻，将她带到这里来。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130610] = {talk_id = 102130610, group_id = 1021306, type = 2, next_id = 0, talk_content = "就是刚刚与我争吵并跑出去的那位。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"刻刻是谁？", 102130612}, {"为什么要拜托我？", 102130611}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130611] = {talk_id = 102130611, group_id = 1021306, type = 3, next_id = 102130613, talk_content = "因为你是脉者，刻刻是最近派到这里来的新人，她本质不坏，但立功心切，放任不管的话我怕会闯出祸来。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130612] = {talk_id = 102130612, group_id = 1021306, type = 3, next_id = 102130613, talk_content = "刻刻是最近派到这里来的新人，她本质不坏，但立功心切，放任不管的话我怕会闯出祸来。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130613] = {talk_id = 102130613, group_id = 1021306, type = 1, next_id = 102130614, talk_content = "平时的话我差遣别人便是，但不巧的是现在司内大部分人都被我派到外面执行任务。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130614] = {talk_id = 102130614, group_id = 1021306, type = 1, next_id = 102130615, talk_content = "而我也不能随意离开维安司，拜托了，青乌。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130615] = {talk_id = 102130615, group_id = 1021306, type = 2, next_id = 0, talk_content = "去追任性小孩呐……听着也不是难事，而且之后也能插队，就帮他一下吧，青乌。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"嗯，就接下来吧。", 102130616}, {"就试试吧。", 102130616}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130616] = {talk_id = 102130616, group_id = 1021306, type = 3, next_id = 102130617, talk_content = "就这么定了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130617] = {talk_id = 102130617, group_id = 1021306, type = 3, next_id = 102130618, talk_content = "对了，虽然说通往天柜城的技能被关停了，但是城内的大钟悬本身还保留着原有的功能，初来这里的话你们还是去敲敲求个平安比较好。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130618] = {talk_id = 102130618, group_id = 1021306, type = 3, next_id = 0, talk_content = "原来敲钟这件事是普遍都会做的吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130619] = {talk_id = 102130619, group_id = 1021306, type = 3, next_id = 0, talk_content = "要考虑下吗，也没关系，但干等也挺无聊的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130701] = {talk_id = 102130701, group_id = 1021307, type = 1, next_id = 102130702, talk_content = "刻刻是最近派到这里来的新人，她本质不坏，但立功心切，放任不管的话我怕会闯出祸来。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102130701, 102130705, 102130708}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130702] = {talk_id = 102130702, group_id = 1021307, type = 1, next_id = 102130703, talk_content = "平时的话我差遣别人便是，但不巧的是现在司内大部分人都被我派到外面执行任务。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130703] = {talk_id = 102130703, group_id = 1021307, type = 1, next_id = 102130704, talk_content = "而我也不能随意离开维安司，拜托了，青乌。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130704] = {talk_id = 102130704, group_id = 1021307, type = 2, next_id = 0, talk_content = "去追任性小孩呐……听着也不是难事，而且之后也能插队，就帮他一下吧，青乌。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"嗯，就接下来吧。", 102130705}, {"我思考一下。", 102130708}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130705] = {talk_id = 102130705, group_id = 1021307, type = 3, next_id = 102130706, talk_content = "就这么定了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130706] = {talk_id = 102130706, group_id = 1021307, type = 3, next_id = 102130707, talk_content = "对了，虽然说通往天柜城的技能被关停了，但是城内的大钟悬本身还保留着原有的功能，初来这里的话你们还是去敲敲求个平安比较好。", talk_name = "朱嫦", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130707] = {talk_id = 102130707, group_id = 1021307, type = 3, next_id = 0, talk_content = "原来敲钟这件事是普遍都会做的吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102130708] = {talk_id = 102130708, group_id = 1021307, type = 3, next_id = 0, talk_content = "要考虑下吗，也没关系，但干等也挺无聊的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140101] = {talk_id = 102140101, group_id = 1021401, type = 4, next_id = 102140102, talk_content = "要找人就先找几个路人问问如何，那些在卖东西的就不错。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102140101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140102] = {talk_id = 102140102, group_id = 1021401, type = 4, next_id = 102140103, talk_content = "比起问人我更想你和我说一下太阳的事情。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140103] = {talk_id = 102140103, group_id = 1021401, type = 4, next_id = 102140104, talk_content = "这些事情得讲气氛，气氛到了，我自然就会讲了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140104] = {talk_id = 102140104, group_id = 1021401, type = 4, next_id = 0, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140201] = {talk_id = 102140201, group_id = 1021402, type = 1, next_id = 102140202, talk_content = "噢，是生面孔呢，要买点什么吗？", talk_name = "安琪", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102140201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102140202] = {talk_id = 102140202, group_id = 1021402, type = 1, next_id = 102140203, talk_content = "你这里有啥卖的？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140203] = {talk_id = 102140203, group_id = 1021402, type = 1, next_id = 102140204, talk_content = "日用杂货，药品装备，我们百玲珑是专门贩售各类常品的店铺。", talk_name = "安琪", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140204] = {talk_id = 102140204, group_id = 1021402, type = 1, next_id = 102140205, talk_content = "就是百货一类的？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140205] = {talk_id = 102140205, group_id = 1021402, type = 1, next_id = 102140206, talk_content = "是的，我们这里基本什么都有卖，但假如需要某些特定用途的工具抑或药品的话建议客人还是去专门店的好。", talk_name = "安琪", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140206] = {talk_id = 102140206, group_id = 1021402, type = 1, next_id = 102140207, talk_content = "反之，一般的素材我们这里都有常备，客人之后可以多来看看哦。", talk_name = "安琪", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140207] = {talk_id = 102140207, group_id = 1021402, type = 1, next_id = 102140208, talk_content = "之后会看看的，其实我想问些事情。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140208] = {talk_id = 102140208, group_id = 1021402, type = 1, next_id = 102140209, talk_content = "是什么呢？", talk_name = "安琪", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140209] = {talk_id = 102140209, group_id = 1021402, type = 1, next_id = 102140210, talk_content = "我们正在找一个叫刻刻的女孩，她穿紫色的衣服，是那边维安司的新人，你有见过她吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140210] = {talk_id = 102140210, group_id = 1021402, type = 1, next_id = 102140211, talk_content = "没什么印象，可能没往这边走吧。", talk_name = "安琪", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140211] = {talk_id = 102140211, group_id = 1021402, type = 1, next_id = 102140212, talk_content = "谢谢，打扰你了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140212] = {talk_id = 102140212, group_id = 1021402, type = 1, next_id = 0, talk_content = "没关系没关系，下次来当客人就好。", talk_name = "安琪", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140301] = {talk_id = 102140301, group_id = 1021403, type = 1, next_id = 102140302, talk_content = "这边有股好香的气味哦。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102140301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102140302] = {talk_id = 102140302, group_id = 1021403, type = 1, next_id = 102140303, talk_content = "是食店之类的吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140303] = {talk_id = 102140303, group_id = 1021403, type = 1, next_id = 102140304, talk_content = "两位客人要不要来尝点什么，我们这里也支持外带哦。", talk_name = "纪晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140304] = {talk_id = 102140304, group_id = 1021403, type = 1, next_id = 102140305, talk_content = "有什么吃的？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140305] = {talk_id = 102140305, group_id = 1021403, type = 1, next_id = 102140306, talk_content = "虽然老爸说这季度主打清水百面，但我还是会推荐各位点一份烧艳鸟。", talk_name = "纪晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140306] = {talk_id = 102140306, group_id = 1021403, type = 1, next_id = 102140307, talk_content = "清水白面也能用来当招牌吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140307] = {talk_id = 102140307, group_id = 1021403, type = 1, next_id = 102140308, talk_content = "听着就不好吃对吧，真搞不懂老爸的想法。", talk_name = "纪晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140308] = {talk_id = 102140308, group_id = 1021403, type = 1, next_id = 102140309, talk_content = "不过那个烧什么鸟给我来一份。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140309] = {talk_id = 102140309, group_id = 1021403, type = 1, next_id = 102140310, talk_content = "你吃烧鸟的情景我想想都觉得惊悚，倒是我们是有正事的吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140310] = {talk_id = 102140310, group_id = 1021403, type = 1, next_id = 102140311, talk_content = "对哦，我们在找一个紫色的叫刻刻的小女孩，你有见过吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140311] = {talk_id = 102140311, group_id = 1021403, type = 1, next_id = 102140312, talk_content = "她可不是什么‘小女孩’。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140312] = {talk_id = 102140312, group_id = 1021403, type = 1, next_id = 102140313, talk_content = "你们是说刻刻是吧，她刚才气冲冲地往那边的出口跑过去了。", talk_name = "纪晴", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140313] = {talk_id = 102140313, group_id = 1021403, type = 1, next_id = 102140314, talk_content = "所以说不在熙来里面了？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140314] = {talk_id = 102140314, group_id = 1021403, type = 1, next_id = 0, talk_content = "应该是。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140401] = {talk_id = 102140401, group_id = 1021404, type = 4, next_id = 0, talk_content = "出口有守卫在站岗，问问他刻刻跑那里去了吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102140401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140501] = {talk_id = 102140501, group_id = 1021405, type = 1, next_id = 102140502, talk_content = "你好，我想向你打听一个叫刻刻的女孩，她穿着紫色的衣服……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102140501, 102140503, 102140505, 102140506}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102140502] = {talk_id = 102140502, group_id = 1021405, type = 2, next_id = 0, talk_content = "怎么，你也是没有跟上调查队的候补队员吗？", talk_name = "守卫", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"候补队员？", 102140503}, {"我有不好的预感。", 102140505}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140503] = {talk_id = 102140503, group_id = 1021405, type = 3, next_id = 102140504, talk_content = "嗯，刚刚刻刻突然跑过来问我派出去调查的队伍到哪里去了……所以你并不是候补队员吗？", talk_name = "守卫", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140504] = {talk_id = 102140504, group_id = 1021405, type = 3, next_id = 102140506, talk_content = "应该说那个刻刻也不是呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140505] = {talk_id = 102140505, group_id = 1021405, type = 3, next_id = 102140506, talk_content = "嗯，大概那个刻刻是想要追上调查队吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140506] = {talk_id = 102140506, group_id = 1021405, type = 1, next_id = 102140507, talk_content = "话说回来，这个调查队是调查什么的？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140507] = {talk_id = 102140507, group_id = 1021405, type = 1, next_id = 102140508, talk_content = "是调查’异常‘的队伍，听他们说是想要搞明白反重力区域和那些噬脉生物的关系。", talk_name = "守卫", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140508] = {talk_id = 102140508, group_id = 1021405, type = 1, next_id = 102140509, talk_content = "好像那个司长说过反重力区是噬脉生物的巢穴不是吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140509] = {talk_id = 102140509, group_id = 1021405, type = 1, next_id = 102140510, talk_content = "嗯，所以要调查为什么反重力区会变成它们巢穴的这件事。", talk_name = "守卫", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140510] = {talk_id = 102140510, group_id = 1021405, type = 1, next_id = 102140511, talk_content = "噢，是想要调查原因然后好把噬脉生物赶出去是吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140511] = {talk_id = 102140511, group_id = 1021405, type = 1, next_id = 102140512, talk_content = "是的，毕竟噬脉生物聚起来就会袭击城镇，实在是太麻烦了。", talk_name = "守卫", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140512] = {talk_id = 102140512, group_id = 1021405, type = 1, next_id = 102140513, talk_content = "闲话就谈到这里吧，我们得赶紧追上刻刻。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140513] = {talk_id = 102140513, group_id = 1021405, type = 1, next_id = 102140514, talk_content = "也是，所以调查队是往哪里去了？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140514] = {talk_id = 102140514, group_id = 1021405, type = 1, next_id = 102140515, talk_content = "往山地的方向，刻刻她也朝着那边去了。", talk_name = "守卫", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140515] = {talk_id = 102140515, group_id = 1021405, type = 1, next_id = 0, talk_content = "走吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140601] = {talk_id = 102140601, group_id = 1021406, type = 4, next_id = 102140602, talk_content = "既然这个人不知道那就问下一个吧，我看那边的就不错。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102140601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102140602] = {talk_id = 102140602, group_id = 1021406, type = 4, next_id = 0, talk_content = "你只是单纯觉得那边店面比较大而已吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150101] = {talk_id = 102150101, group_id = 1021501, type = 4, next_id = 102150102, talk_content = "除了那个熙来以外其他地方都是自然环境呢，看来这里的人真不住在地上。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102150101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150102] = {talk_id = 102150102, group_id = 1021501, type = 4, next_id = 102150103, talk_content = "但是倒过来生活真的可以吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150103] = {talk_id = 102150103, group_id = 1021501, type = 4, next_id = 102150104, talk_content = "应该没什么问题吧，他们不也活几百年了？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150104] = {talk_id = 102150104, group_id = 1021501, type = 4, next_id = 0, talk_content = "不敢想象。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150201] = {talk_id = 102150201, group_id = 1021502, type = 4, next_id = 102150202, talk_content = "话说回来，离歌……悬天是什么样的组织？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102150201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150202] = {talk_id = 102150202, group_id = 1021502, type = 4, next_id = 102150203, talk_content = "这时候问起这个吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150203] = {talk_id = 102150203, group_id = 1021502, type = 4, next_id = 102150204, talk_content = "我有一堆问题，只是都被你用’时机‘躲过去了。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150204] = {talk_id = 102150204, group_id = 1021502, type = 4, next_id = 102150205, talk_content = "那这次也让我这么躲过去吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150205] = {talk_id = 102150205, group_id = 1021502, type = 4, next_id = 102150206, talk_content = "喂。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150206] = {talk_id = 102150206, group_id = 1021502, type = 4, next_id = 0, talk_content = "只要进了城，你不想知道也不行。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150301] = {talk_id = 102150301, group_id = 1021503, type = 1, next_id = 102150302, talk_content = "走到这里也没看见人，是我中途走错了吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102150301, 102150305, 102150306, 102150307, 102150314, 102150315}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = false, hide_npc_list = {}},
	[102150302] = {talk_id = 102150302, group_id = 1021503, type = 1, next_id = 102150303, talk_content = "或者说守卫给我们指了错路。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150303] = {talk_id = 102150303, group_id = 1021503, type = 1, next_id = 102150304, talk_content = "他没有骗我们的理由，往别的方向走吧，司命。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150304] = {talk_id = 102150304, group_id = 1021503, type = 2, next_id = 0, talk_content = "等等，你就没有看见眼前那个如此吸人眼球的空洞吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"的确", 102150305}, {"我不觉得", 102150306}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150305] = {talk_id = 102150305, group_id = 1021503, type = 3, next_id = 102150307, talk_content = "对吧对吧，在荒郊野岭突然有扇像是经人修饰，诡异无比大门，很勾人心弦对吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150306] = {talk_id = 102150306, group_id = 1021503, type = 3, next_id = 102150307, talk_content = "你这个没情趣的家伙，就不明白这其中到底蕴含着什么浪漫吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150307] = {talk_id = 102150307, group_id = 1021503, type = 1, next_id = 102150308, talk_content = "所以这东西到底是什么，感觉靠近这玩意以后你连说话的语气都恶心了好多倍。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150308] = {talk_id = 102150308, group_id = 1021503, type = 1, next_id = 102150309, talk_content = "哼哼，这个叫作空洞，是世界的缺陷。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150309] = {talk_id = 102150309, group_id = 1021503, type = 1, next_id = 102150310, talk_content = "何为缺憾这点我稍后再作说明，但一般来说在空洞里面可以搞到不少好东西。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150310] = {talk_id = 102150310, group_id = 1021503, type = 1, next_id = 102150311, talk_content = "所以你的目的是里面的宝物吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150311] = {talk_id = 102150311, group_id = 1021503, type = 1, next_id = 102150312, talk_content = "有时候是宝物，有时候是其他东西，不过那里面肯定有不少好玩意。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150312] = {talk_id = 102150312, group_id = 1021503, type = 1, next_id = 102150313, talk_content = "我觉得你应该改名叫守财奴之类的比较好……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150313] = {talk_id = 102150313, group_id = 1021503, type = 2, next_id = 0, talk_content = "反正人大概我们也找不到了，要不要进去看看？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"……就上一次你的当吧。", 102150314}, {"先等一下。", 102150315}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150314] = {talk_id = 102150314, group_id = 1021503, type = 3, next_id = 0, talk_content = "嘻嘻，向空洞出发！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150315] = {talk_id = 102150315, group_id = 1021503, type = 3, next_id = 0, talk_content = "要继续找人是可以还是想先做点准备，对我来说也没差就是了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150401] = {talk_id = 102150401, group_id = 1021504, type = 2, next_id = 0, talk_content = "要进空洞对吧，要进空洞对吧！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"……就上一次你的当吧。", 102150402}, {"我拒绝。", 102150403}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102150401, 102150402, 102150403}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150402] = {talk_id = 102150402, group_id = 1021504, type = 3, next_id = 0, talk_content = "嘻嘻，向空洞出发！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102150403] = {talk_id = 102150403, group_id = 1021504, type = 3, next_id = 0, talk_content = "要继续找人是可以还是想先做点准备，对我来说也没差就是了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102160101] = {talk_id = 102160101, group_id = 1021601, type = 1, next_id = 102160102, talk_content = "怎样，我没骗你吧，不过我也没想到有人会在空洞里面学会新技能呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102160101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102160102] = {talk_id = 102160102, group_id = 1021601, type = 1, next_id = 102160103, talk_content = "不是学会，而是回忆了……那应该是我以前用过的招式。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102160103] = {talk_id = 102160103, group_id = 1021601, type = 1, next_id = 102160104, talk_content = "司命，你说过这个地方是世界的缺陷是吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102160104] = {talk_id = 102160104, group_id = 1021601, type = 1, next_id = 102160105, talk_content = "嗯，这个地方的构成，景色，对于现金世界来说都是被废弃的东西。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102160105] = {talk_id = 102160105, group_id = 1021601, type = 1, next_id = 102160106, talk_content = "是谁把东西丢进了空洞的意思吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102160106] = {talk_id = 102160106, group_id = 1021601, type = 1, next_id = 102160107, talk_content = "是谁我就不知道了，怎么一脸凝重，你是又想起什么了吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102160107] = {talk_id = 102160107, group_id = 1021601, type = 1, next_id = 0, talk_content = "不，只是我觉得自己应该认识这个地方。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170101] = {talk_id = 102170101, group_id = 1021701, type = 1, next_id = 102170102, talk_content = "本以为这个地方会暗藏危机，但实际上要比想象温和很多。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102170101, 102170128, 102170135}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102170102] = {talk_id = 102170102, group_id = 1021701, type = 1, next_id = 102170103, talk_content = "空洞是会随着各种因素变化的，刚好这个是比较温和那类而已。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170103] = {talk_id = 102170103, group_id = 1021701, type = 1, next_id = 102170104, talk_content = "看着也没有敌人了，我们离开这里吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170104] = {talk_id = 102170104, group_id = 1021701, type = 1, next_id = 102170105, talk_content = "等等。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170105] = {talk_id = 102170105, group_id = 1021701, type = 1, next_id = 102170106, talk_content = "？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170106] = {talk_id = 102170106, group_id = 1021701, type = 1, next_id = 102170107, talk_content = "我认为是合适的地点和时机，司命。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170107] = {talk_id = 102170107, group_id = 1021701, type = 1, next_id = 102170108, talk_content = "是要说太阳的事情对吧，明明对拯救世界没什么兴趣。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170108] = {talk_id = 102170108, group_id = 1021701, type = 1, next_id = 102170109, talk_content = "无论要不要拯救世界，那些人口中和你描述的就不一样。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170109] = {talk_id = 102170109, group_id = 1021701, type = 1, next_id = 102170110, talk_content = "你说太阳是祸害世界之物，我在看见那副景象的时候也是这么想的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170110] = {talk_id = 102170110, group_id = 1021701, type = 1, next_id = 102170111, talk_content = "可实际上，这里的人却崇敬太阳，而太阳也拯救过这些人，而他们的神情也并不是说谎者该有的样貌。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170111] = {talk_id = 102170111, group_id = 1021701, type = 1, next_id = 102170112, talk_content = "哦呵，所以你在怀疑我罗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170112] = {talk_id = 102170112, group_id = 1021701, type = 1, next_id = 102170113, talk_content = "怀疑这个把一半生命分给了你的我？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170113] = {talk_id = 102170113, group_id = 1021701, type = 1, next_id = 102170114, talk_content = "所以是如何，我说过我虽失去了记忆，但绝对不会被人摆布，假若你真是骗子，那这条命在这里还给你也没所谓。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170114] = {talk_id = 102170114, group_id = 1021701, type = 1, next_id = 102170115, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170115] = {talk_id = 102170115, group_id = 1021701, type = 1, next_id = 102170116, talk_content = "别用那种眼神看着我，这不是搞得我跟个反派似的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170116] = {talk_id = 102170116, group_id = 1021701, type = 1, next_id = 102170117, talk_content = "……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170117] = {talk_id = 102170117, group_id = 1021701, type = 1, next_id = 102170118, talk_content = "哎，我知道了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170118] = {talk_id = 102170118, group_id = 1021701, type = 1, next_id = 102170119, talk_content = "我不了解人类历史中太阳到底都做了些什么，但是我可没有说谎。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170119] = {talk_id = 102170119, group_id = 1021701, type = 1, next_id = 102170120, talk_content = "我从诞生之初就知道太阳是为恶之物，恐怕那个司长说过的反重力云云的东西也是那个太阳造成的影响。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170120] = {talk_id = 102170120, group_id = 1021701, type = 1, next_id = 102170121, talk_content = "就不能是自然灾害吗，那个太阳升起已经数百年了吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170121] = {talk_id = 102170121, group_id = 1021701, type = 1, next_id = 102170122, talk_content = "你要这么说那我也没办法反驳，但就算如此我的天命都不会改变。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170122] = {talk_id = 102170122, group_id = 1021701, type = 1, next_id = 102170123, talk_content = "在这个世界之中，每个人都有每个人的天命，青乌二字是你的天命，所以你在失去记忆以后仍然记得。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170123] = {talk_id = 102170123, group_id = 1021701, type = 1, next_id = 102170124, talk_content = "而我的天命，就是不顾一切去协助你拯救世界。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170124] = {talk_id = 102170124, group_id = 1021701, type = 1, next_id = 102170125, talk_content = "虽然至今为止的表现可能不值得你信任，但假若真到那个时候的话，我把剩下的半条命也给你都可以。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170125] = {talk_id = 102170125, group_id = 1021701, type = 1, next_id = 102170126, talk_content = "我没有让你把剩下的半条命给我，而是想要知道你所说的是否真实。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170126] = {talk_id = 102170126, group_id = 1021701, type = 1, next_id = 102170127, talk_content = "是真的，我刚刚这么说就代表我愿意用性命去担保。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170127] = {talk_id = 102170127, group_id = 1021701, type = 2, next_id = 0, talk_content = "太阳，以及太阳带来的恩惠……绝对是危害世界之物。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"（相信他。）", 102170128}, {"（保留意见。）", 102170135}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170128] = {talk_id = 102170128, group_id = 1021701, type = 3, next_id = 102170129, talk_content = "……一开始这么说不就好了，诚实才是最大的武器，没人跟你说过这件事吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170129] = {talk_id = 102170129, group_id = 1021701, type = 3, next_id = 102170130, talk_content = "这不符合我的性格，再者一上来大条道理也没用，你要寻找记忆，而我能给你自由活动的生命。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170130] = {talk_id = 102170130, group_id = 1021701, type = 3, next_id = 102170131, talk_content = "我认为最初只要维持这样的利益关系就足够了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170131] = {talk_id = 102170131, group_id = 1021701, type = 3, next_id = 102170132, talk_content = "你这个别扭精。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170132] = {talk_id = 102170132, group_id = 1021701, type = 3, next_id = 102170133, talk_content = "话都谈完了就走吧，不然等下空洞门关上就没法跑了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170133] = {talk_id = 102170133, group_id = 1021701, type = 3, next_id = 102170134, talk_content = "真会关上吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170134] = {talk_id = 102170134, group_id = 1021701, type = 3, next_id = 0, talk_content = "不知道捏。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170135] = {talk_id = 102170135, group_id = 1021701, type = 3, next_id = 102170136, talk_content = "虽然你这个告白的确有些出乎意料，但口说无凭……", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170136] = {talk_id = 102170136, group_id = 1021701, type = 3, next_id = 102170137, talk_content = "你先听着就好，到时候你自然会明白我才是正确的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170137] = {talk_id = 102170137, group_id = 1021701, type = 3, next_id = 102170138, talk_content = "话都谈完了就走吧，不然等下空洞门关上就没法跑了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170138] = {talk_id = 102170138, group_id = 1021701, type = 3, next_id = 102170139, talk_content = "真会关上吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102170139] = {talk_id = 102170139, group_id = 1021701, type = 3, next_id = 0, talk_content = "不知道捏。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180101] = {talk_id = 102180101, group_id = 1021801, type = 1, next_id = 102180102, talk_content = "你好你好，你们刚刚从空洞回来是吧？", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102180101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180102] = {talk_id = 102180102, group_id = 1021801, type = 1, next_id = 102180103, talk_content = "你是……还有你是怎么在我耳边说话的？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180103] = {talk_id = 102180103, group_id = 1021801, type = 1, next_id = 102180104, talk_content = "只是有点小手段而已，对了，你叫我阿一就好。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180104] = {talk_id = 102180104, group_id = 1021801, type = 1, next_id = 102180105, talk_content = "这名字和阿猫阿狗听上去差不多呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180105] = {talk_id = 102180105, group_id = 1021801, type = 1, next_id = 102180106, talk_content = "哈哈哈，我这名字可是由尊贵的……咳咳，这个先不提了。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180106] = {talk_id = 102180106, group_id = 1021801, type = 1, next_id = 102180107, talk_content = "总之你们先回城里一趟吧，我手上有能帮到你们的东西噢。", talk_name = "阿一", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180107] = {talk_id = 102180107, group_id = 1021801, type = 1, next_id = 102180108, talk_content = "要去吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180108] = {talk_id = 102180108, group_id = 1021801, type = 1, next_id = 0, talk_content = "至少现在找人这个委托大概是落空了，顺道回去做个报告吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180201] = {talk_id = 102180201, group_id = 1021802, type = 5, next_id = 102180202, talk_content = "我刚见到你们的时候就知道你们并不简单。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102180201}, addition_relevance_id = {102180301}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102180202] = {talk_id = 102180202, group_id = 1021802, type = 5, next_id = 102180203, talk_content = "只是没想到竟然能只靠一人就从空洞中全身而退。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180203] = {talk_id = 102180203, group_id = 1021802, type = 5, next_id = 102180204, talk_content = "青乌，那个女的不就是！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180204] = {talk_id = 102180204, group_id = 1021802, type = 5, next_id = 102180205, talk_content = "嗯。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180205] = {talk_id = 102180205, group_id = 1021802, type = 5, next_id = 0, talk_content = "我的名字叫刻刻，时时刻刻的刻刻，我听说你们在找我对吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180301] = {talk_id = 102180301, group_id = 1021803, type = 1, next_id = 102180302, talk_content = "我们的确是在找你，但是你为什么会在城里面，不是追着调查队去了吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102180301, 102180307, 102180308, 102180309}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[102180302] = {talk_id = 102180302, group_id = 1021803, type = 1, next_id = 102180303, talk_content = "因为发现追不上所以就放弃了，相反地我找到了另外的能用来立功的东西。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180303] = {talk_id = 102180303, group_id = 1021803, type = 1, next_id = 102180304, talk_content = "立功的东西？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180304] = {talk_id = 102180304, group_id = 1021803, type = 1, next_id = 102180305, talk_content = "新的反重力区，里面似乎已已经有噬脉生物盘踞了。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180305] = {talk_id = 102180305, group_id = 1021803, type = 1, next_id = 102180306, talk_content = "说到底反重力区也不是滋生噬脉生物的地方，只是容易被当成巢穴而已，无论有没有那个，噬脉生物聚起来以后还是会袭击我们居住的地方。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180306] = {talk_id = 102180306, group_id = 1021803, type = 2, next_id = 0, talk_content = "那么与其费尽心思查明真相，还不如直接让我们这样的脉者扫荡反重力区要轻松一些吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"的确", 102180307}, {"有点治标不治本", 102180308}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180307] = {talk_id = 102180307, group_id = 1021803, type = 3, next_id = 102180309, talk_content = "我就知道你会同意的，那走吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180308] = {talk_id = 102180308, group_id = 1021803, type = 3, next_id = 102180309, talk_content = "能治不就行了，我们走吧！", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180309] = {talk_id = 102180309, group_id = 1021803, type = 1, next_id = 102180310, talk_content = "等等，走去哪？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180310] = {talk_id = 102180310, group_id = 1021803, type = 1, next_id = 102180311, talk_content = "那当然是那个反重力区了，你们想要去天柜城对吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180311] = {talk_id = 102180311, group_id = 1021803, type = 1, next_id = 102180312, talk_content = "我们是想去，但这有什么联系？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180312] = {talk_id = 102180312, group_id = 1021803, type = 1, next_id = 102180313, talk_content = "上面的人说是解除危机后就会重新开通天柜城的出入境，与其等那些调查队寻找不知道是啥的东西，你不觉得自己动手来的更快吗？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180313] = {talk_id = 102180313, group_id = 1021803, type = 1, next_id = 102180314, talk_content = "……但是我接到的委托是带你回去。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180314] = {talk_id = 102180314, group_id = 1021803, type = 1, next_id = 102180315, talk_content = "我可不会跟你回去就是了，我需要尽快立功升职好回天柜城，而你也想要到天柜城去。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180315] = {talk_id = 102180315, group_id = 1021803, type = 1, next_id = 102180316, talk_content = "我认为我们应该可以合作才是。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180316] = {talk_id = 102180316, group_id = 1021803, type = 1, next_id = 102180317, talk_content = "要合作的话我们还不如找司长，他还能帮忙插队呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180317] = {talk_id = 102180317, group_id = 1021803, type = 1, next_id = 102180318, talk_content = "……呃，你这么说也是。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180318] = {talk_id = 102180318, group_id = 1021803, type = 1, next_id = 102180319, talk_content = "真被司命驳倒了？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180319] = {talk_id = 102180319, group_id = 1021803, type = 1, next_id = 102180320, talk_content = "没办法，那在这之上我就再加点筹码……和你们签个’相契‘如何？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180320] = {talk_id = 102180320, group_id = 1021803, type = 1, next_id = 102180321, talk_content = "相契？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180321] = {talk_id = 102180321, group_id = 1021803, type = 1, next_id = 102180322, talk_content = "是一种以气脉为媒介的特殊契约，在一些重要的事件上都会用这个来做公证，我也见过人类之间签订这种契约的情景。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180322] = {talk_id = 102180322, group_id = 1021803, type = 1, next_id = 102180323, talk_content = "所以是合约一类的东西……那合约的内容是什么？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180323] = {talk_id = 102180323, group_id = 1021803, type = 1, next_id = 102180324, talk_content = "自然是互相帮助了，我看你们就一副会惹事上身的感觉，应该有不少时候都需要别人帮忙吧。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180324] = {talk_id = 102180324, group_id = 1021803, type = 1, next_id = 102180325, talk_content = "的确……在拯救世界的路上多几个伙伴也不是坏事。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180325] = {talk_id = 102180325, group_id = 1021803, type = 1, next_id = 102180326, talk_content = "我还没有说自己要拯救世界。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180326] = {talk_id = 102180326, group_id = 1021803, type = 1, next_id = 102180327, talk_content = "所以怎么说，要立契吗？", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180327] = {talk_id = 102180327, group_id = 1021803, type = 1, next_id = 102180328, talk_content = "不过的确，考虑到我的状况，有时候多一个帮手并不是坏事。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102180328] = {talk_id = 102180328, group_id = 1021803, type = 1, next_id = 0, talk_content = "很好。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102190101] = {talk_id = 102190101, group_id = 1021901, type = 4, next_id = 102190102, talk_content = "对了，说了这么久都忘记问了。", talk_name = "刻刻", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {102190101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[102190102] = {talk_id = 102190102, group_id = 1021901, type = 4, next_id = 102190103, talk_content = "什么？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
