	[202010102] = {talk_id = 202010102, group_id = 2020101, type = 1, next_id = 202010103, talk_content = "怎么一上来就牛头不搭马嘴的，你一个人呆在这大郊野的干啥呢？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010103] = {talk_id = 202010103, group_id = 2020101, type = 1, next_id = 202010104, talk_content = "呃，对对，应该先说这个。", talk_name = "游商", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010104] = {talk_id = 202010104, group_id = 2020101, type = 1, next_id = 202010105, talk_content = "小人是一位旅行商人，主要做的工作就是奔波各地倒卖一些特产之类的。", talk_name = "游商", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010105] = {talk_id = 202010105, group_id = 2020101, type = 1, next_id = 202010106, talk_content = "今天来这也是因为想在熙来赚点小钱，但路上的噬脉生物实在太猖狂，小人只好躲在这里等候好心人了。", talk_name = "游商", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010106] = {talk_id = 202010106, group_id = 2020101, type = 2, next_id = 0, talk_content = "一直瞄着这边呢……青乌，你要帮她吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"就帮帮她吧。", 202010107}, {"有报酬的话……", 202010108}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010107] = {talk_id = 202010107, group_id = 2020101, type = 3, next_id = 202010109, talk_content = "十分感谢，小人一看见你的英姿就明白你不会拒绝的！", talk_name = "游商", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010108] = {talk_id = 202010108, group_id = 2020101, type = 3, next_id = 202010109, talk_content = "肯定，肯定，小人行商多年行情什么的都懂！", talk_name = "游商", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
