	[202010409] = {talk_id = 202010409, group_id = 2020104, type = 1, next_id = 202010410, talk_content = "虽说那些杂鱼们是变得比平常活跃，但这个量怎么想都不对路。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010410] = {talk_id = 202010410, group_id = 2020104, type = 1, next_id = 202010411, talk_content = "而能够解释这点的唯一线索，恐怕就是你的货物有什么能吸引噬脉生物的特质。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"该不会是危险品吧？", 202010107}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202010411] = {talk_id = 202010411, group_id = 2020104, type = 1, next_id = 202010412, talk_content = "那得看过才知道，快，打开你的背包，肯定是什么超级值钱的东西！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
