	[202010603] = {talk_id = 202010603, group_id = 2020106, type = 1, next_id = 202010604, talk_content = "这人的最终目的是进城里去，要是她没被噬脉生物吃掉的话那总能碰见的。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
