	[202020109] = {talk_id = 202020109, group_id = 2020201, type = 3, next_id = 202020110, talk_content = "是的，今天是我第一次出摊，刚好缺了点测试这个小游戏的帮手。", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020110] = {talk_id = 202020110, group_id = 2020201, type = 3, next_id = 202020111, talk_content = "想让我们做测试呐……有报酬吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020111] = {talk_id = 202020111, group_id = 2020201, type = 3, next_id = 202020112, talk_content = "我这里有些小礼品，假如你们能成功通过游戏的话那我可以给你们送一些哦。", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020112] = {talk_id = 202020112, group_id = 2020201, type = 3, next_id = 0, talk_content = "一言为定，上吧青乌！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020201] = {talk_id = 202020201, group_id = 2020202, type = 2, next_id = 0, talk_content = "恭喜你，成功过关了，顺带问问，你觉得这个游戏的难度如何？", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"有些难。", 202020203}, {"太简单了。", 202020202}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202020201, 202020202, 202020203, 202020204}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020202] = {talk_id = 202020202, group_id = 2020202, type = 3, next_id = 202020204, talk_content = "太简单了吗，也好，毕竟脉者的简单其实就相当于普通人的困难了。", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020203] = {talk_id = 202020203, group_id = 2020202, type = 3, next_id = 202020204, talk_content = "看来是我难度设置有些问题，我知道了，后面会改善的。", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020204] = {talk_id = 202020204, group_id = 2020202, type = 1, next_id = 202020205, talk_content = "所以说我们帮你搞定那啥测试了，奖励呢？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020205] = {talk_id = 202020205, group_id = 2020202, type = 1, next_id = 202020206, talk_content = "我已经准备好了，奖励就是这些小物品以及可以再参加一次打气球游戏的奖卷哦？", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020206] = {talk_id = 202020206, group_id = 2020202, type = 1, next_id = 0, talk_content = "……这不是摆明了想让我们白打工吗！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020301] = {talk_id = 202020301, group_id = 2020203, type = 1, next_id = 0, talk_content = "摊现在还在收拾，请稍后再来吧。", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202020301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202020401] = {talk_id = 202020401, group_id = 2020204, type = 1, next_id = 0, talk_content = "气球我都放好了，你准备好就到摊位去吧。", talk_name = "摊贩", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202020401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030101] = {talk_id = 202030101, group_id = 2020301, type = 1, next_id = 202030102, talk_content = "那边的脉者，你就是青乌对吧？", talk_name = "流丽", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202030101, 202030104, 202030105, 202030106}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030102] = {talk_id = 202030102, group_id = 2020301, type = 1, next_id = 202030103, talk_content = "哦……你知道我们？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030103] = {talk_id = 202030103, group_id = 2020301, type = 2, next_id = 0, talk_content = "之前有听司长说过，对了，我是一位维安司警。", talk_name = "流丽", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"我不太想自己广为人知。", 202030104}, {"所以你喊住我想做什么？", 202030105}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030104] = {talk_id = 202030104, group_id = 2020301, type = 3, next_id = 202030106, talk_content = "毕竟悬天的家伙可是盯着我们呢，总之你这小司警要说些啥？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030105] = {talk_id = 202030105, group_id = 2020301, type = 3, next_id = 202030106, talk_content = "一看就知道是有东西要拜托我们了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030106] = {talk_id = 202030106, group_id = 2020301, type = 1, next_id = 202030107, talk_content = "是这样的，最近因为噬脉生物的问题导致城内也不太安稳，一些流氓盗贼也混进了城中。", talk_name = "流丽", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030107] = {talk_id = 202030107, group_id = 2020301, type = 1, next_id = 202030108, talk_content = "假若他们只是来避避风头倒没什么关系，但没想到他们还干起了偷鸡摸狗的勾当。", talk_name = "流丽", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030108] = {talk_id = 202030108, group_id = 2020301, type = 1, next_id = 202030109, talk_content = "截止到昨天，我们已经有好几个仓库被盗，损失了不少财物……", talk_name = "流丽", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030109] = {talk_id = 202030109, group_id = 2020301, type = 1, next_id = 202030110, talk_content = "所以是要我们捉住犯人吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030110] = {talk_id = 202030110, group_id = 2020301, type = 1, next_id = 202030111, talk_content = "不，为了捉住犯人我们已经组织了专项组，我只是想要拜托青乌你们帮我去搬运一批货物。", talk_name = "流丽", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030111] = {talk_id = 202030111, group_id = 2020301, type = 1, next_id = 202030112, talk_content = "这个拜托其他人不就好了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030112] = {talk_id = 202030112, group_id = 2020301, type = 1, next_id = 202030113, talk_content = "呃，现在城内鱼龙混杂，维安司人手不足，为了货物不再失窃，只能拜托能信任的人来了。", talk_name = "流丽", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030113] = {talk_id = 202030113, group_id = 2020301, type = 1, next_id = 0, talk_content = "所以说我们就是被信任的人呀……哼哼，没办法，就帮帮你吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030201] = {talk_id = 202030201, group_id = 2020302, type = 1, next_id = 202030202, talk_content = "一件，三件，要带走的数应该都对上了吧……", talk_name = "像是工人的人", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202030201, 202030205, 202030206, 202030208, 202030213, 202030214, 202030217}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030202] = {talk_id = 202030202, group_id = 2020302, type = 1, next_id = 202030203, talk_content = "这不是已经有人在了吗，喂！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
