	[202030209] = {talk_id = 202030209, group_id = 2020302, type = 1, next_id = 202030210, talk_content = "呃……呃，那你们又是来干啥的？", talk_name = "像是工人的人", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030210] = {talk_id = 202030210, group_id = 2020302, type = 1, next_id = 202030211, talk_content = "我们是受拜托来运货的人，结果刚来到就发现你在点货了，难不成那个货车司机拜托了两个人吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030211] = {talk_id = 202030211, group_id = 2020302, type = 1, next_id = 202030212, talk_content = "……，看来就是你说的那样呢，我也受到拜托要来搬货了，我脚下这些就是准备要送走的货物。", talk_name = "像是工人的人", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202030212] = {talk_id = 202030212, group_id = 2020302, type = 2, next_id = 0, talk_content = "数量也不多，这些我一个人就能搬完，抱歉，好像让你们白跑一趟了。", talk_name = "像是工人的人", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"（有些可疑。）", 202030213}, {"你真的是搬货的吗？", 202030214}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
