	[202040106] = {talk_id = 202040106, group_id = 2020401, type = 1, next_id = 202040107, talk_content = "就如你们所知的，创生地中大部分据点都受到了噬脉生物的侵扰，一些还落到了怪物手中。", talk_name = "安检员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202040107] = {talk_id = 202040107, group_id = 2020401, type = 1, next_id = 202040108, talk_content = "所以我们希望有人去定期打击那些噬脉生物，为我们清理据点。", talk_name = "安检员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202040108] = {talk_id = 202040108, group_id = 2020401, type = 1, next_id = 202040109, talk_content = "定期和清理，听起来像是你觉得那些据点肯定会丢好几次那样。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
