	[202040301] = {talk_id = 202040301, group_id = 2020403, type = 1, next_id = 202040302, talk_content = "我们按照约定把据点清理干净了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202040301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202040302] = {talk_id = 202040302, group_id = 2020403, type = 1, next_id = 202040303, talk_content = "谢谢，我这边也得到线路重新接入系统的信息了。", talk_name = "安检员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202040303] = {talk_id = 202040303, group_id = 2020403, type = 1, next_id = 202040304, talk_content = "果然拜托单独脉者是正确的，要是靠司警的话恐怕下个月都没法恢复系统呢。", talk_name = "安检员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202040304] = {talk_id = 202040304, group_id = 2020403, type = 1, next_id = 202040305, talk_content = "的确那些司警看起来是挺忙的，话说你口中的系统是什么呐？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202040305] = {talk_id = 202040305, group_id = 2020403, type = 1, next_id = 0, talk_content = "呃……这个就是商业机密了，总之请收下清理据点的报酬吧，假若下次还有问题我会再找你们的。", talk_name = "安检员", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050101] = {talk_id = 202050101, group_id = 2020501, type = 1, next_id = 202050102, talk_content = "1号确认，2号确认……糟糕，又是4号这笨蛋！这样下去我的研究还怎么……", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050101, 202050108}, addition_relevance_id = {202051001}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[202050102] = {talk_id = 202050102, group_id = 2020501, type = 1, next_id = 202050103, talk_content = "是研究人员呐，你是在找什么东西吗？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050103] = {talk_id = 202050103, group_id = 2020501, type = 1, next_id = 202050104, talk_content = "确切来说是在找脉灵啦。唉，早知道这么麻烦，当初就不应该一时兴起选择脉灵作为研究领域……", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050104] = {talk_id = 202050104, group_id = 2020501, type = 1, next_id = 202050105, talk_content = "是那种圆滚滚的小生物吧。它们和其他气脉动物有什么区别吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050105] = {talk_id = 202050105, group_id = 2020501, type = 1, next_id = 202050106, talk_content = "你不知道，它们要是能像普通动物一样乖乖待在研究所里，我可要烧高香了。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050106] = {talk_id = 202050106, group_id = 2020501, type = 1, next_id = 202050107, talk_content = "实际上，它们像气脉一样行踪不定，还兼具动物的灵性，喜欢和人类开玩笑。要我说啊，简直像一朵会说话的云一样。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050107] = {talk_id = 202050107, group_id = 2020501, type = 2, next_id = 0, talk_content = "尤其是这个4号，它特别喜欢捉迷藏，还要拉着人类陪它一起玩。唉，真是麻烦的爱好……", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"如果是脉者或许可以办到。", 202050108}, {"只要跑得够快就可以吧。", 202050108}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050108] = {talk_id = 202050108, group_id = 2020501, type = 3, next_id = 202050109, talk_content = "道理确实是这样。不过就像我刚才说的，抓住脉灵可不像抓普通动物那么容易。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050109] = {talk_id = 202050109, group_id = 2020501, type = 3, next_id = 202050110, talk_content = "正好我这里有一台新近开发的仪器，可以定位脉灵的方位和距离，或许可以拿来试试。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050110] = {talk_id = 202050110, group_id = 2020501, type = 3, next_id = 202051001, talk_content = "既然如此，可不可以拜托两位帮我找找它？咳，倒也不是担心它，都是因为研究罢了……", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050201] = {talk_id = 202050201, group_id = 2020502, type = 4, next_id = 202050202, talk_content = "脉灵可不是什么容易抓到的东西，青乌你之前应该已经见识过了吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050202] = {talk_id = 202050202, group_id = 2020502, type = 4, next_id = 202050203, talk_content = "嗯，不妨现在就用这台仪器试试吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050203] = {talk_id = 202050203, group_id = 2020502, type = 4, next_id = 202050204, talk_content = "喔，居然真的显示出方位和距离了，小研究员果然有两把刷子呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050204] = {talk_id = 202050204, group_id = 2020502, type = 4, next_id = 0, talk_content = "不对，有这么厉害的东西，干脆自己去抓不就好了！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050301] = {talk_id = 202050301, group_id = 2020503, type = 4, next_id = 202050302, talk_content = "竹叶长，竹笋香，绿竹林里捉迷藏。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050302] = {talk_id = 202050302, group_id = 2020503, type = 4, next_id = 202050303, talk_content = "竹花黄，秋雨忙，竹下分别无相忘。", talk_name = "？？？", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050303] = {talk_id = 202050303, group_id = 2020503, type = 4, next_id = 202050304, talk_content = "司命，你听到了吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050304] = {talk_id = 202050304, group_id = 2020503, type = 4, next_id = 0, talk_content = "是脉灵的声音，我们已经离它很近了，再仔细找找看吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050401] = {talk_id = 202050401, group_id = 2020504, type = 4, next_id = 202050402, talk_content = "嘻哈，不好不好，被看到了！", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050402] = {talk_id = 202050402, group_id = 2020504, type = 4, next_id = 0, talk_content = "哼哼，谁让你念得那么大声？青乌，抓住收工咯。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050501] = {talk_id = 202050501, group_id = 2020505, type = 4, next_id = 0, talk_content = "快逃快逃，捉鬼人追上来了！", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050501, 202050502}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050502] = {talk_id = 202050502, group_id = 2020505, type = 4, next_id = 202050502, talk_content = "喂，逃得也太快了吧！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050601] = {talk_id = 202050601, group_id = 2020506, type = 4, next_id = 202050602, talk_content = "嘻哈，才不会被你抓到呢。", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050602] = {talk_id = 202050602, group_id = 2020506, type = 4, next_id = 202050603, talk_content = "啧，又让它跑掉了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050603] = {talk_id = 202050603, group_id = 2020506, type = 4, next_id = 202050604, talk_content = "在玩捉迷藏的游戏么？按照那位科研员的说法，它好像一直都是这样。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050604] = {talk_id = 202050604, group_id = 2020506, type = 4, next_id = 0, talk_content = "听起来有点奇怪呢，不过总之先跟上去再说！", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050701] = {talk_id = 202050701, group_id = 2020507, type = 4, next_id = 202050702, talk_content = "嘻哈，没什么力气了……", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050702] = {talk_id = 202050702, group_id = 2020507, type = 4, next_id = 202050703, talk_content = "不行不行，被抓到的话，就没办法当冠军了……", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050703] = {talk_id = 202050703, group_id = 2020507, type = 4, next_id = 0, talk_content = "它的行动好像比之前迟缓了，趁现在赶快追上去吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050801] = {talk_id = 202050801, group_id = 2020508, type = 1, next_id = 202050802, talk_content = "呼……呼……", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050801, 202050803, 202050804}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[202050802] = {talk_id = 202050802, group_id = 2020508, type = 2, next_id = 0, talk_content = "什么啊，居然就这么睡着了。不过青乌你有没有发现，这地方的气氛很是特别呐。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"这里有点像是脉灵生活过的地方。", 202050803}, {"说起来，这个地方……", 202050803}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050803] = {talk_id = 202050803, group_id = 2020508, type = 3, next_id = 202050804, talk_content = "可惜这里的气脉竹全都枯黄了。气脉缺失，脉灵的体力自然也会流失吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050804] = {talk_id = 202050804, group_id = 2020508, type = 1, next_id = 202050805, talk_content = "这里过去大概是一片很茂盛的竹林呢，不过现在应该早就没有脉灵生活了吧。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050805] = {talk_id = 202050805, group_id = 2020508, type = 1, next_id = 202050806, talk_content = "嘻哈……竹叶长，竹笋香，唔……", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050806] = {talk_id = 202050806, group_id = 2020508, type = 1, next_id = 202050807, talk_content = "哼哼，居然还说起梦话来了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050807] = {talk_id = 202050807, group_id = 2020508, type = 1, next_id = 202050808, talk_content = "五十五万五千五百个数字，我早就已经数完了……", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050808] = {talk_id = 202050808, group_id = 2020508, type = 1, next_id = 0, talk_content = "明明已经藏了这么久……怎么还是没有人找到我呢……", talk_name = "4号", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050901] = {talk_id = 202050901, group_id = 2020509, type = 1, next_id = 202050902, talk_content = "原来是跑到这里来了吗……", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202050901, 202050911, 202050912, 202050913}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[202050902] = {talk_id = 202050902, group_id = 2020509, type = 1, next_id = 202050903, talk_content = "你认识这个地方吗？", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050903] = {talk_id = 202050903, group_id = 2020509, type = 1, next_id = 202050904, talk_content = "嗯，这里……其实是我第一次遇到4号的地方。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050904] = {talk_id = 202050904, group_id = 2020509, type = 1, next_id = 202050905, talk_content = "当时这里的气脉竹受到了不小的破坏，我到附近考察时，在一座山洞里发现了它。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050905] = {talk_id = 202050905, group_id = 2020509, type = 1, next_id = 202050906, talk_content = "那时它已经快要消散了，可是嘴里还在念叨着那首捉迷藏的童谣。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050906] = {talk_id = 202050906, group_id = 2020509, type = 1, next_id = 202050907, talk_content = "大概是前不久还在和同伴一起玩耍吧，所以才念念不忘，走到哪里都惦记着要玩捉迷藏的游戏。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050907] = {talk_id = 202050907, group_id = 2020509, type = 1, next_id = 202050908, talk_content = "可是……已经没有脉灵会找到它了吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050908] = {talk_id = 202050908, group_id = 2020509, type = 1, next_id = 202050909, talk_content = "在我们科研人员看来，脉灵的生命是这世间最奇妙的存在，几乎永远介于无限与须臾之间。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050909] = {talk_id = 202050909, group_id = 2020509, type = 1, next_id = 202050910, talk_content = "它们拥有人类的情感和语言，却也同时拥有最无法捉摸的寿命。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050910] = {talk_id = 202050910, group_id = 2020509, type = 2, next_id = 0, talk_content = "新生的脉灵像人类的孩童一样单纯，并不知道自己会随着气脉的断流而消散，或许还在盼望着伙伴可以长久地陪在自己身边吧。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"至少你会给它们新的家园。", 202050912}, {"至少它们不会觉得悲伤。", 202050911}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050911] = {talk_id = 202050911, group_id = 2020509, type = 3, next_id = 202050913, talk_content = "……说的也是呢。至少我会尽力保证它们一直如此。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050912] = {talk_id = 202050912, group_id = 2020509, type = 3, next_id = 202050913, talk_content = "……说的也是呢。也许这就是我能做到的全部吧。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050913] = {talk_id = 202050913, group_id = 2020509, type = 1, next_id = 202050914, talk_content = "那么走吧，4号。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202050914] = {talk_id = 202050914, group_id = 2020509, type = 1, next_id = 0, talk_content = "该回家了。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202051001] = {talk_id = 202051001, group_id = 2020510, type = 2, next_id = 0, talk_content = "听起来不是件容易差事呢。青乌你觉得如何？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"可以试试。", 6}, {"现在没什么时间。", 202051002}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202051001, 202051002}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[202051002] = {talk_id = 202051002, group_id = 2020510, type = 3, next_id = 0, talk_content = "这样啊，那我只能自己找找了。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202051101] = {talk_id = 202051101, group_id = 2020511, type = 1, next_id = 0, talk_content = "那就麻烦二位了。路上当心一点，那家伙很狡猾的。", talk_name = "傅生", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202051101}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202051201] = {talk_id = 202051201, group_id = 2020512, type = 4, next_id = 0, talk_content = "离目标好像越来越远了。青乌，你的失忆不会已经严重到连人类科技都使用不了的程度了吧？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202051201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060101] = {talk_id = 202060101, group_id = 2020601, type = 1, next_id = 202060102, talk_content = "你是脉者对吗？太好了，终于有办法了……", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202060101, 202060110}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[202060102] = {talk_id = 202060102, group_id = 2020601, type = 1, next_id = 202060103, talk_content = "喂，不要什么事都直接寄托在脉者身上啊。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060103] = {talk_id = 202060103, group_id = 2020601, type = 1, next_id = 202060104, talk_content = "唉，要不是事情实在棘手，也不会拜托给脉者的。", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060104] = {talk_id = 202060104, group_id = 2020601, type = 1, next_id = 202060105, talk_content = "是这么回事，附近的郊区近来一直不太平。", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060105] = {talk_id = 202060105, group_id = 2020601, type = 1, next_id = 202060106, talk_content = "那里过去据说是一片乱葬岗，最近一段时间总有噬脉生物出没，还有人类的黑影和怪声。", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060106] = {talk_id = 202060106, group_id = 2020601, type = 1, next_id = 202060107, talk_content = "虽然近几天的噬脉生物数量已经减少了一些，但还是搞得人心惶惶。不知道是有人作怪还是什么气脉乱流，真是让人担心……", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060107] = {talk_id = 202060107, group_id = 2020601, type = 1, next_id = 202060108, talk_content = "往好处想想，兴许只是闹鬼呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060108] = {talk_id = 202060108, group_id = 2020601, type = 1, next_id = 202060109, talk_content = "噫……噫！！", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060109] = {talk_id = 202060109, group_id = 2020601, type = 2, next_id = 0, talk_content = "总、总之事情的情况就是这样，不知道二位能不能帮忙去调查看看？", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {{"现在不太方便。", 202060110}, {"交给我们吧。", 6}}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060110] = {talk_id = 202060110, group_id = 2020601, type = 3, next_id = 0, talk_content = "既然这样，那就不麻烦你们了……", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202060201}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = true, hide_all_entity = true, hide_npc_list = {}},
	[202060301] = {talk_id = 202060301, group_id = 2020603, type = 1, next_id = 0, talk_content = "那就请到那边去看看吧，拜托二位了！", talk_name = "青崖", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202060301}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060401] = {talk_id = 202060401, group_id = 2020604, type = 4, next_id = 202060402, talk_content = "这就是发生怪事的地方吗，现在好像一片太平呐。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202060401}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060402] = {talk_id = 202060402, group_id = 2020604, type = 4, next_id = 0, talk_content = "如果真的发生过怪事，就一定会留下痕迹。先在这附近调查一下吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060501] = {talk_id = 202060501, group_id = 2020605, type = 1, next_id = 202060502, talk_content = "肉眼看来没有什么异常。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202060501}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060502] = {talk_id = 202060502, group_id = 2020605, type = 1, next_id = 202060503, talk_content = "空气里的确有噬脉生物的气息，不过并不算太重啊。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060503] = {talk_id = 202060503, group_id = 2020605, type = 1, next_id = 0, talk_content = "这样说来，这里有噬脉生物活动过，但数量尚且应付得来。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060601] = {talk_id = 202060601, group_id = 2020606, type = 1, next_id = 202060602, talk_content = "有噬脉生物的足迹，但却没有人类的。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202060601}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060602] = {talk_id = 202060602, group_id = 2020606, type = 1, next_id = 202060603, talk_content = "所以没有人类和它们一起活动呢。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060603] = {talk_id = 202060603, group_id = 2020606, type = 1, next_id = 0, talk_content = "还不能确定，再找找看吧。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060701] = {talk_id = 202060701, group_id = 2020607, type = 1, next_id = 202060702, talk_content = "（石头上刻着模糊的字迹，只能辨认出“义人”“长眠”“冢”几个字）", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {202060701}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060702] = {talk_id = 202060702, group_id = 2020607, type = 1, next_id = 202060703, talk_content = "原来是什么人的墓碑啊，修成这样也太狼狈了。", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060703] = {talk_id = 202060703, group_id = 2020607, type = 1, next_id = 202060704, talk_content = "不知道它的主人到底是谁呢。", talk_name = "叙慕", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
	[202060704] = {talk_id = 202060704, group_id = 2020607, type = 1, next_id = 202060705, talk_content = "刚才嗅到的噬脉生物气息就是从这里传来的，说不定里面放着什么坏东西，待会儿就挖开看看怎么样？", talk_name = "司命", back_groud = "", back_text = "", cut_mark = false, not_skip = false, skip_target_time = 0.00, options = {}, custom_camera = false, fade_in = 0, fade_out = false, relevance_id = {}, addition_relevance_id = {}, position = {}, close_sound_channel = {}, hide_player = false, hide_all_entity = false, hide_npc_list = {}},
